(339, 'of_template', 'a:251:{i:0;a:2:{s:4:"name";s:7:"General";s:4:"type";s:7:"heading";}i:1;a:4:{s:4:"name";s:22:"Configuración general";s:3:"std";s:78:"Un puñado de ajustes de gran alcance para mejorar la experiencia del usuario.";s:5:"class";s:14:"heading-parent";s:4:"type";s:4:"info";}i:2;a:5:{s:4:"name";s:17:"Activar Karma 4.0";s:4:"desc";s:424:"Marque esta casilla para activar Karma 4.0. Esto mejorará su experiencia el tema mediante la limpieza de las antiguas plantillas de página y la configuración que ya no son necesarios por el Karma 4.0. <br /> <em>(Los usuarios que actualicen desde versiones anteriores de Karma no debe marcar esta casilla. Necesitará las viejas plantillas de página y la configuración para el buen funcionamiento de su sitio web.)</em>";s:2:"id";s:18:"ka_activate_karma4";s:3:"std";s:5:"false";s:4:"type";s:8:"checkbox";}i:3;a:5:{s:4:"name";s:11:"Módulo SEO";s:4:"desc";s:202:"Marque esta casilla para activar un módulo de SEO completamente optimizado para este tema. <em>Por favor, deshabilite todos los demás plugins SEO antes de activar para evitar posibles conflictos.</em>";s:2:"id";s:13:"ka_seo_module";s:3:"std";s:5:"false";s:4:"type";s:8:"checkbox";}i:4;a:5:{s:4:"name";s:10:"Cajas Meta";s:4:"desc";s:274:"Esta funcionalidad oculta cajas meta en el tablero de instrumentos para ayudar a Wordpress siente más como un CMS. Esto incluye: Comentarios, Discusión, Trackbacks, campos personalizados, autor y Slug <em>Quite la marca de esta casilla para desactivar esta función..</em>";s:2:"id";s:14:"ka_hidemetabox";s:3:"std";s:4:"true";s:4:"type";s:8:"checkbox";}i:5;a:5:{s:4:"name";s:18:"Edición en línea";s:4:"desc";s:277:"Esta funcionalidad añade un botón de línea de edición a todas las páginas y mensajes de manera que ha iniciado la sesión en los administradores pueden rápidamente y fácilmente editar su página web. <em>Quite la marca de esta casilla para desactivar esta función.</em>";s:2:"id";s:17:"ka_inline_editing";s:3:"std";s:4:"true";s:4:"type";s:8:"checkbox";}i:6;a:5:{s:4:"name";s:34:"Desactivar TimThumb Image Resizing";s:4:"desc";s:475:"Marque esta casilla para desactivar la imagen TimThumb script de redimensionamiento. El guión TimThumb se activa cada vez que se visualice una imagen que tiene (no) ha subido a la biblioteca de medios de WordPress. Esta opción es para los usuarios que deseen recortar sus propias imágenes alojadas externamente. Si has activado esta opción y las imágenes no se cargan correctamente desmarque amablemente esta opción para devolver el script TimThumb de nuevo en el tema.";s:2:"id";s:22:"ka_deactivate_timthumb";s:3:"std";s:5:"false";s:4:"type";s:8:"checkbox";}i:7;a:4:{s:4:"name";s:22:"Código de seguimiento";s:4:"desc";s:54:"Pega Google Analytics (u otro) código de seguimiento.";s:2:"id";s:19:"ka_google_analytics";s:4:"type";s:8:"textarea";}i:8;a:2:{s:4:"name";s:6:"Móvil";s:4:"type";s:7:"heading";}i:9;a:4:{s:4:"name";s:24:"Configuración de Mobile";s:3:"std";s:88:"Especifique cómo su sitio web se comportará cuando se ve en los dispositivos móviles.";s:5:"class";s:14:"heading-parent";s:4:"type";s:4:"info";}i:10;a:5:{s:4:"name";s:28:"Desactivar Responsive Design";s:4:"desc";s:209:"Marque esta casilla para desactivar diseño de respuesta del Karma. Un diseño de respuesta hace que su sitio web para móviles de usar al ajustar el diseño de la página de acuerdo con el dispositivo móvil.";s:2:"id";s:13:"ka_responsive";s:3:"std";s:5:"false";s:4:"type";s:8:"checkbox";}i:11;a:5:{s:4:"name";s:11:"Mobile Menu";s:4:"desc";s:80:"Este texto se muestra al lado del botón Menu Mobile. <em>(Menú principal)</em>";s:2:"id";s:19:"ka_mobile_menu_text";s:3:"std";s:9:"Main Menu";s:4:"type";s:4:"text";}i:12;a:5:{s:4:"name";s:19:"Desactivar Subpages";s:4:"desc";s:97:"Marque esta casilla para desactivar subpáginas en el menú de Mobile. <em>(Menú principal)</em>";s:2:"id";s:19:"ka_mobile_menu_subs";s:3:"std";s:5:"false";s:4:"type";s:8:"checkbox";}i:13;a:5:{s:4:"name";s:15:"Mobile Sub Menu";s:4:"desc";s:226:"El S