r, lea <a href=\\"http://code.google.com/intl/pt-PT/apis/recaptcha/docs/customization.html\\" target=\\"_blank\\">la documentación de desarrollador reCAPTCHA</a> para más detalles. <br/><br/> <u><strong>Notas importantes:</strong></u> <br/> Por favor, cambiar los códigos de javascript de documentación google usar <strong>comillas dobles</strong> en lugar de comillas simples para todas las variables de javascript.";s:2:"id";s:19:"ka_recaptcha_custom";s:4:"type";s:8:"textarea";}i:232;a:2:{s:4:"name";s:20:"Páginas de Utilidad";s:4:"type";s:7:"heading";}i:233;a:4:{s:4:"name";s:20:"Páginas de Utilidad";s:3:"std";s:81:"Personalizar la página de error 404, Resultados de Búsqueda y Páginas Sitemap.";s:5:"class";s:14:"heading-parent";s:4:"type";s:4:"info";}i:234;a:5:{s:4:"name";s:19:"Error 404 - Título";s:4:"desc";s:115:"Establecer el título de la página que se mostrará en el área de ruta de navegación de la página de error 404.";s:2:"id";s:11:"ka_404title";s:3:"std";s:14:"Page not Found";s:4:"type";s:4:"text";}i:235;a:5:{s:4:"name";s:21:"Error 404 - Contenido";s:4:"desc";s:82:"Establecer el contenido de la página que se mostrará en la página de error 404.";s:2:"id";s:13:"ka_404message";s:3:"std";s:270:"Our Apologies, but the page you are looking for could not be found. Here are some links that you might find useful:\n			<ul>\n			<li><a href="http://www.">Home</a></li>\n			<li><a href="http://www.">Sitemap</a></li>\n			<li><a href="http://www.">Contact Us</a></li>\n			</ul>";s:4:"type";s:8:"textarea";}i:236;a:4:{s:4:"name";s:26:"Resultados de la búsqueda";s:3:"std";s:70:"Configuración personalizada de la página de resultados de búsqueda.";s:5:"class";s:33:"heading-parent heading-parent-alt";s:4:"type";s:4:"info";}i:237;a:5:{s:4:"name";s:45:"Resultados de búsqueda - página del título";s:4:"desc";s:118:"Establecer el título de la página que se mostrará en el área de ruta de navegación de la resultados de búsqueda.";s:2:"id";s:16:"ka_results_title";s:3:"std";s:14:"Search Results";s:4:"type";s:4:"text";}i:238;a:5:{s:4:"name";s:44:"Resultados de búsqueda - Mensaje de retorno";s:4:"desc";s:84:"Establezca el mensaje que se mostrará cuando la búsqueda se vuelve sin resultados.";s:2:"id";s:19:"ka_results_fallback";s:3:"std";s:107:"<p>Our Apologies, but your search did not return any results. Please try using a different search term.</p>";s:4:"type";s:8:"textarea";}i:239;a:4:{s:4:"name";s:15:"Ajustes Sitemap";s:3:"std";s:103:"Los siguientes ajustes sólo son necesarios cuando se utiliza la plantilla de página Mapa del sitio-2.";s:5:"class";s:33:"heading-parent heading-parent-alt";s:4:"type";s:4:"info";}i:240;a:5:{s:4:"name";s:38:"Mapa del sitio - columna de un título";s:4:"desc";s:74:"Este título aparece encima de la lista de páginas de la primera columna.";s:2:"id";s:19:"ka_sitemap2_column1";s:3:"std";s:5:"Pages";s:4:"type";s:4:"text";}i:241;a:5:{s:4:"name";s:36:"Mapa del sitio - Columna Dos Título";s:4:"desc";s:72:"Este título aparece encima de la lista de correo en la segunda columna.";s:2:"id";s:19:"ka_sitemap2_column2";s:3:"std";s:5:"Posts";s:4:"type";s:4:"text";}i:242;a:5:{s:4:"name";s:39:"Mapa del sitio - Columna Tres contenido";s:4:"desc";s:48:"Este contenido se muestra en la tercera columna.";s:2:"id";s:19:"ka_sitemap2_column3";s:3:"std";s:151:"<h3>Contact</h3>\n    <p><strong>Email:</strong> <a href="mailto:you@yoursite.com">you@yoursite.com</a><br />\n	<strong>Mobile:</strong> 444-555-6666</p>";s:4:"type";s:8:"textarea";}i:243;a:2:{s:4:"name";s:13:"Twitter OAuth";s:4:"type";s:7:"heading";}i:244;a:4:{s:4:"name";s:13:"Twitter OAuth";s:3:"std";s:379:"A partir del 11 de junio 2013 Twitter ha apagado su API pública y las últimas funcionalidades de twitter ahora requiere las credenciales de autenticación se enumeran a continuación. <strong>¿Necesita ayuda?</strong> <a href=\\"https://support.truethemes.net/?knowledgebase=twitter-feed-down-latest-tweets-not-displaying\\" target=\\"_blank\\">Ver este artículo HelpDesk →</a>";s:5:"class";s:14:"heading-parent";s:4:"type";s:4:"info";}i:245;a:4:{s:4:"name";s:20:"Clave del Consumidor";s:4:"desc";s:52:"Escribir clave de Consumo de la aplicación Twitter.";s:2:"id";s:24:"twitter_api_consumer_key";s:4:"type";s:4:"text";}i:246;a:4:{s:4:"name";s:17:"Secret Consumidor";s:4:"desc";s:55:"Introduzca de la aplicación Twitter Secret Consumidor.";s:2:"id";s:27:"twitter_api_consumer_secret";s:4:"type";s:4:"text";}i:247;a:4:{s:4:"name";s:15:"El acceso Token";s:4:"desc";s:55:"Introduzca testigo de acceso de la aplicación Twitter.";s:2:"id";s:24:"twitter_api_access_token";s:4:"type";s:4:"text";}i:248;a:4:{s:4:"name";s:22:"El acceso Token Secret";s:4:"desc";s:60:"Introduzca de la aplicación Twitter de acceso Token Secret.";s:2:"id";s:31:"twitter_api_access_token_secret";s:4:"type";s:4:"text";}i:249;a:5:{s:4:"name";s:13:"Timing caché";s:4:"desc";s:263:"Últimos tweets deben almacenarse en caché con el fin de cumplir con los límites de Twitter API de llamadas. <br /> Por favor, seleccione el intervalo de tiempo de caché deseado. <br /> (Nuevos tweets se actualizará según el intervalo de tiempo seleccionado)";s:2:"id";s:20:"twitter_cache_timing";s:4:"type";s:14:"select-advance";s:7:"options";a:4:{i:1800;s:10:"30 minutes";i:3600;s:6:"1 hour";i:7200;s:7:"2 Hours";i:10800;s:7:"3 hours";}}i:250;a:5:{s:4:"name";s:26:"Desactivar caché temporal";s:4:"desc";s:239:"Utilice esta opción para desactivar temporalmente la caché durante la configuración para que los cambios se reflejan inmediatamente. Recuerde apagar el caché de nuevo después de haber confirmado los tweets se está mostrando muy bien.";s:2:"id";s:20:"twitter_cache_status";s:4:"type";s:6:"select";s:7:"options";a:2:{s:6:"enable";s:13:"Turn on Cache";s:7:"disable";s:14:"Turn off Cache";}}}', 'yes');
