(152, 'ptthemes_main_content', '<p>Lamentamos informar que por inconvenientes en nuestro sitio nos vemos obligados a permanecer fuera de linea unas horas.<br/>Sabiendo que todas las cosas ayudan a bien, aprovecharemos este breve lapso para</p>\r\n \r\n<ul>\r\n     <li> <strong>actualizar algunos contenidos</strong>  <br/> \r\n      queremos brindarle nuevos mensajes, bosquejos y devocionales</li> \r\n     <li><strong>mejorar la apariencia y desempeño del sitio</strong>  <br/> \r\n      Vamos a re definir la forma en que nuestro sitio le proporciona el material que necesita</li> \r\n</ul>\r\n\r\n<p>Por cualquier consulta o inquietud, por favor, comuníquese a <a mailto=\\"info@puertadevida.com.ar\\">Nuestra casilla de Correo</a> o diríjase a nuestro <a href=\\"http://www.facebook.com/puertadevida.mardelplata\\">Sitio en Facebook</a>.<br/>\r\nPara recibir noticias en su cuenta de correo, déjenos su dirección </p>', 'yes'),
