(456, 'notifier-cache', '<?xml version="1.0" encoding="UTF-8"?>\n<notifier>\n	<latest>3.0.3</latest>\n	<changelog>\n<![CDATA[\n<h4>Version 3.0.3</h4>\n<ul>\n<li><strong>Overview:</strong></li>\n<li>Full WPML Multilingual Compatibility.</li>\n<li>Updated Multilingual Localization Files.</li>\n<li>Minor CSS Bug fixes.</li>\n<li>Minor JavaScript Adjustments.</li>\n<li>--------------------------------------------</li>\n<li><strong>- File Update:</strong> <em>truethemes_framework_init.php</em> declare add theme support for woocommerce.</li>\n<li><strong>- File Update:</strong> <em>wp-cumulus.php seo_module.php seo_module_class.php widgets.php woocommerce.php</em> updated localization textdomain name.</li>\n<li><strong>- File Update:</strong> <em>wpml-config.xml</em> fixed xml structure error, so that all admin text strings gets included, previously only 2 strings are loaded. added custom fields.</li>\n<li><strong>- File Update:</strong> <em>theme-template-part-content-blog.php</em> added check for WPML and custom query for posts page.</li>\n<li><strong>- File Update:</strong> <em>archive.php</em> Make titles translatable.</li>\n<li><strong>- File Update:</strong> <em>comments.php and page-comments.php</em> Make password protected message translatable at line 5 and 9. Replace _x(''Your Comments'') with __(''Your Comments'') at line 89 and 101 as WPML does not support _x()</li>\n<li><strong>- File Update:</strong> <em>search.php</em> Make search title translatable</li>\n<li><strong>- File Update:</strong> <em>shortcodes.php</em>Line 793 blog_posts shortcode rewrite to use WP_query. Line 1504 related_posts shortcode, Make ''no related posts'' string translatable.</li>\n<li><strong>- File Update:</strong> <em>en_US.po and en_US.mo</em> Updated with new translatable strings.</li>\n<li><strong>- File Update:</strong> <em>style.css</em> Updated with WPML language dropdown menu fix.</li>\n<li><strong>- File Update:</strong> <em>Renamed file to jquery-ui-1.9.2.custom.min.js</em> Updated with latest jquery ui so that our theme does not break third party jquery ui plugins.</li>\n<li><strong>- File Update:</strong> <em>basic.php</em> line 128, get comment cookie information of current commenter (if any) to prefill comment form details.</li>\n<li><strong>- File Update:</strong> <em>truethemes_framework/theme-specific/site-option.php, comments.php, page-comments.php</em> Add the ability to use WordPress default avatar.</li>\n<li><strong>- File Update:</strong> <em>truethemes_framework/js/jquery.prettySociable.js</em> Line 18-119 : Updated URL''s for Social icons. Now hosting on Amazon S3 server.</li>\n</ul>\n\n<h4>Version 3.0.2</h4>\n<ul>\n<li><strong>- File Update:</strong> <em>truethemes_framework_init.php</em> Improve on Jetpack plugin check.</li>\n<li><strong>- File Update:</strong> <em>header.php</em> Updated with IE9 conditional comment html class before html tag</li>\n<li><strong>- New function:</strong> <em>basic.php</em> New function tt_IE10_css_fix_for_content_full_width() to hook into wp_head, IE10 padding fix for .content_full_width in jQuery 2 template and homepage 3d template</li>\n<li><strong>- File Update:</strong> <em>header.php</em> fixed respond.js javascript script link file path.</li>\n<li><strong>- File Update:</strong> <em>lt8.css</em> added css fix to unhide image and video in jQuery slider in IE8</li>\n<li><strong>- File Update:</strong> <em>theme-specific/admin-functions.php</em> added PHP check before outputting background image css, to prevent image url with null.png causing image link error in error console.</li>\n<li><strong>- File Update:</strong> <em>theme-specific/admin-functions.php</em> htmlspecialchars_decode function added in line 172 to prevent sanitize of site option custom css codes.</li>\n<li><strong>- File Update:</strong> <em>en_US.po and en_US.mo</em> Updated file with new translation strings.</li>\n<li><strong>- File Update:</strong> <em>timthumb.php</em> Updated to latest version 2.8.11</li>\n<li><strong>- File Update:</strong> <em>/truethemes_framework/js/truethemes.js</em> Updated JavaScript to fix "dissapearing menu" bug.</li>\n<li><strong>- File Update:</strong> <em>/truethemes_framework/js/truethemes.js</em> removed old tabs init code and add in new function initTabs to allow url link to activate tab.</li>\n<li><strong>- File Update:</strong> <em>_woocommerce.css</em> Fixed CSS for woocommerce version 2.0.2</li>\n<li><strong>- File Update:</strong> <em>grunion-contact-form.php</em> Fix message icon background image url path.</li>\n</ul>\n\n<h4>Version 3.0.1</h4>\n<ul>\n<li><strong>- File Update:</strong> <em>truethemes.js and style.css</em> changed mobile menu to a normal list, remove first item toggle. Fixes unclickable first level menu item.</li>\n<li><strong>- File Update:</strong> <em>admin-functions.php</em> changed woocommerce css to use get_template_directory_uri</li>\n<li><strong>- File Update:</strong> <em>template_sitemap-2.php</em> stripslashes to echo $sitemap_column3 to fix broken email address.</li>\n<li><strong>- File Update:</strong> <em>404.php</em> stripslashes to title and message to fix broken url.</li>\n<li><strong>- File Update:</strong> <em>_woocommerce.css</em> .chzn-results css fix for auto populate states in checkout page</li>\n<li><strong>- File Update:</strong> <em>admin-functions.php</em> Updated with checks for Jetpack plugin, show global notification in Theme activation view if detected.</li>\n<li><strong>- File Update:</strong> <em>basic.php</em> Added support for multisite wp-signup.php, which is the public registration page.</li>\n<li><strong>- File Update:</strong> <em>shortcodes.php</em> Fixed accordion and tabs shortcode bug, by removing reference to missing callback function, and rewriting back to WordPress standard shortcode format.</li>\n<li><strong>- Overview:</strong> Minor bug fixes, Responsive optimizations</li>\n<li><strong>- File Update:</strong> <em>style.css</em> Added fixes for broken "Google +" and "Email" social icons.</li>\n<li><strong>- File Update:</strong> <em>/images/_global/global-sprite.png</em> Added images for "Google +" and "Email" social icons.</li>\n<li><strong>- File Update:</strong> <em>style.css</em> fixed spacing bug in IE8+ on jQuery2page template.</li>\n<li><strong>- File Update:</strong> <em>/css/mobile.css</em> fixed layout in mobile/iPad view. (Left Nav + Sidebar, Right Nav + Sidebar, WooCommerce Sidebar).</li>\n</ul>\n\n<h4>Version 3.0</h4>\n<ul>\n<li><strong>- Overview:</strong> Repsonsive Design, Inline Page-Editing, Boxed Layout, Body Backgrounds, Per-Page Styling, Comments on Pages, Updated Theme Designer Options, WooCommerce Compatibility, Wordpress 3.5 Compatibility.</li>\n<li><strong>- File Update:</strong> <em>/framework/admin/images/bg-icn.png</em> Added Icon for WooCommerce Page.</li>\n<li><strong>- File Update:</strong> <em>header.php</em> Wrapped Main Navigation in Nav Element.</li>\n<li><strong>- File Update:</strong> <em>theme-template-part-tools.php</em> Added functionality for per-page Search Bar display.</li>\n<li><strong>- File Update:</strong> <em>all page templates</em> Added conditional PHP for inline page editing.</li>\n<li><strong>- File Update:</strong> <em>/truethemes_framework/js/truethemes.js</em> Added jQuery for Responsive Select Menu.</li>\n<li><strong>- File Update:</strong> <em>/truethemes_framework/truethemes_framework_init.php</em> Added code to load MetaBox Functionality.</li>\n<li><strong>- File Update:</strong> <em>/truethemes_framework/theme_spcific/_theme_specific_init.php</em> Added code to load metabox.php</li>\n<li><strong>- File Update:</strong> <em>screenshot.png</em> Modified screenshot dimensions as per WordPress 3.5 retina display requirements (600x450px)</li>\n<li><strong>- Site Options Panel:</strong> Added new option for Responsive Design.</li>\n<li><strong>- Site Options Panel:</strong> Added new option for Inline Page Editing.</li>\n<li><strong>- Site Options Panel:</strong> Added new option for Boxed Layout.</li>\n<li><strong>- Site Options Panel:</strong> Added new option for Body Background Color.</li>\n<li><strong>- Site Options Panel:</strong> Added new option for Body Background Image.</li>\n<li><strong>- Site Options Panel:</strong> Added new option for Body Background Image Position.</li>\n<li><strong>- Site Options Panel:</strong> Added new option for Body Background Image repeat.</li>\n<li><strong>- Added New File:</strong> /css/_mobile.css</li>\n<li><strong>- Added New File:</strong> /truethemes_framework/theme_specific/metabox.php</li>\n<li><strong>- Added New Folder:</strong> /images/_shortcodes</li>\n<li><strong>- Added New Folder:</strong> /truethemes_framework/truethemes/metabox</li>\n</ul>\n\n<h4>Version 2.7.2</h4>\n<ul>\n<li>- Fixed version compare logic in update notifier.</li>\n<li>- Add Custom submenu in page admin for left and right nav templates.</li>\n<li>- Fixed timthumb multi site image url check.</li>\n</ul>\n<h4>Version 2.7.1</h4>\n<ul>\n<li>- Fixed breadcrumb error in attachment.php when viewing unattached picture</li>\n<li>- Prevent WordPress autosave in reverting portfolio category in edit page view</li>\n<li>- Optimized Error Reporting</li>\n<li>- Optimized Timthumb URL for multi-site</li>\n</ul>\n<h4>Version 2.7.0</h4>\n<ul>\n<li>- Total rewrite of contact form codes forked from grunion contact form and updated to latest version. Removed contact form folder from truethemes folder and added grunion-contact-form folder under extended folder.</li>\n<li>- Fixed updating of default settings into database, upon theme activation</li>\n<li>- Added multiple sidebar widget class</li>\n<li>- Fixed CSS bug for centered content on full-width page template.</li>\n</ul>\n<h4>Version 2.6.9</h4>\n<ul>\n<li>- Added suppress warning, notice, deprecated, and user notice when WP_DEBUG is set to true - functions.php</li>\n<li>- Fixed bug in SEO module option to allow uncheck of checkbox settings - seo_module_class.php</li>\n</ul>\n<h4>Version 2.6.8</h4>\n<ul>\n<li>- Upgraded jQuery prettyPhoto script to the latest version (v3.1.3)</li>\n<li>- Upgraded TimThumb script to the latest version (v2.8.9)</li>\n<li>- Added minor CSS fixes to bottom of style.css.</li>\n</ul>\n<h4>Version 2.6.7</h4>\n<ul>\n<li>- Fixed wploop_exclude function in theme-functions.php. This fixes single category view permalink conflict, when access via category dropdown widget. Allows permalink other than default number type.</li>\n<li>- Comment out addition of negative category IDs to archive page permalinks in theme-functions.php</li>\n<li>- Renamed internal reCaptcha library functions to avoid re-declaration error conflict with plugins.</li>\n<li>- Fixed typo error in variable comment_author_url_label in truethemes-contact-form.php</li>\n</ul>\n<h4>Version 2.6.6</h4>\n<ul>\n<li>- Updated single.php and archive.php on hiding tools panel option</li>\n<li>- updated missing strings into po file and contact form script</li>\n<li>- Show breadcrumb of parent post in attachment.php</li>\n<li>- Do not show attachment title in toolbar</li>\n<li>- Add styles of attachment.php to end of style.css</li>\n<li>- Added attachment.php</li>\n</ul>\n<h4>Version 2.6.5</h4>\n<ul>\n<li>- Fixes contact form inserting in WordPress Admin for latest WP version compatibility.</li>\n<li>- Remove unprocessed shortcode from blog post excerpt.</li>\n<li>- Fixed disable jQuery slider pause</li>\n<li>- Fixed duplicate SEO meta tags</li>\n<li>- Updated en_US.po and en_US.mo file</li>\n<li>- Fixed missing translation strings in comments.php and single.php</li>\n<li>- Added wmode transparent to video embed code</li>\n<li>- Removed error suppressing code in basic.php</li>\n<li>- Added option to disable update notifier, to speed up WordPress Admin loading</li>\n<li>- Fixed disabled of drag share when post date and comment count is disabled</li> \n</ul>\n<h4>Version 2.6.4</h4>\n<ul>\n<li>- Converted entire theme to HTML5</li> \n<li>- Minor page heading tweaks for better SEO</li>\n<li>- CSS tweaks for greater overriding flexibility</li>\n<li>- Code optimization for greater theme performance</li>\n<li>- Added Featured video capability to jQuery1 + jQuery2 homepage sliders</li>\n<li>- Added "2nd level" navigation capability to top-toolbar nav</li>\n<li>- Completely localized the theme and included .mo/.po files. Theme is now completely translation ready.</li>\n</ul>\n<br/>\n<h4>Version 2.6.3</h4>\n<ul>\n<li>- Emergency bug fix release.</li> \n<li>- Removed usage of WordPress core function get_theme_data from truethemes_framework_init.php, to prevent fopen error in web hosts that does not allow PHP fopen function.</li>\n</ul>\n<br/>\n<h4>Version 2.6.2</h4>\n<ul>\n<li>- Rewrite twitter shortcode to use cURL instead of simpleXML_load_file, to prevent fopen error.</li>\n<li>- Fixes timthumb url defined constant for multi site installation.</li>\n<li>- Removed theme check for function truethemes_disabled_comments</li>\n<li>- Fixed posts paragraph extra padding.</li>\n</ul>\n<br/>\n<h4>Version 2.6.1</h4>\n<ul>\n<li>- Fixes Framework Loading Issue in Child Theme. Affects Child Theme only.</li>\n<li>- Fixes advances option main content font css.</li>\n</ul>\n<br/>\n<h4>Version 2.6</h4>\n<ul>\n<li>- Added SEO module</li>\n<li>- User able to break content into pages by using nextpage tag in html editor.</li>\n<li>- Updated list shortcode to work in notify boxes.</li>\n<li>- Allows user to specify which accordion slide to open by default.</li>\n<li>- Support for reCAPtcha custom theme</li>\n<li>- Reorganized javascript loading to speed up theme.</li>\n<li>- Fixed featured image linking.</li>\n<li>- Reorganized file structure. Separated files into templates and framework.</li>\n<li>- Added class truethemes_site_option in basic.php to create $ttso global variable.</li>\n<li>- Updated timthumb.php to latest version 2.4</li>\n<li>- Added two menu locations in basic.php namely, footer menu, top toolbar menu. Changed Main navigation to Main Menu.</li>\n<li>- Modified header.php, added checks for top toolbar menu, if there is menu attached, show it, if not show dynamic toolbar "Toolbar - Left Side".</li>\n<li>- Modified footer.php, added checks for footer menu, if there is menu attached, show it, if not show dynamic toolbar "Footer Navigation - Right Side".</li>\n<li>- Added "tools panel" setting to interface option (site option). Do checks in tools.php and index.php, to show or hide, according to user setting.</li> \n<li>- Added "Post Comments" setting to blog setting (site option), Do checks in single.php to show or hide comments template.</li>\n<li>- Added function truethemes_disable_comments() in functions/admin/theme-functions.php to update user setting, into WordPress admin settings/discussion/ … This option auto updates WordPress "discussion" -"Allow people to post comments on new articles" option.</li>\n<li>- Added "Breadcrumbs - text" to interface option (site option). Do checks in breadcrumb.php to show user entered text for home page link. defaults to "Home".<li>- \n<li>- Added "submit button - text" to forms section.</li>\n<li>- Created new "Advance Options" panel and all it''s settings!</li>\n<li>- Modified karma_settings_css() in theme-functions.php to output css for all settings value in new "Advance Option" panel.<li>- \n<li>- Renamed karma_setting_css() to truethemes_setting_css(), added helper functions truethemes_push_custom_css and truetheme_push_custom_font()</li>\n</ul>\n<br/>\n<h4>Version 2.4</h4>\n<ul>\n<li>- Further modifications to image-thumbs script for even greater compatibility.</li>\n<li>- Added new functions to basic.php for organizing new content.</li>\n<li>- Added some codes to shortcode.php for organizing new content.</li>\n<li>- Added timthumb fallback script for users who wish to resize images that are not on their own server.</li>\n<li>- Added filters in the theme options to allow developers to program their own custom options.</li>\n</ul>\n<br>\n<h4>Version 2.3</h4>\n<ul>\n<li>- Modified "functions/truethemes/image-thumbs.php" for greater server compatibility</li>\n<li>- Minor bug fixes to remove any WP_DEBUG errors.</li>\n</ul>\n<br>\n<h4>Version 2.2</h4>\n<ul>\n<li>- Minor bug fixes to jQuery2 homepage (fullsize banner image)</li>\n<li>- Minor bug fixes to Archives page template</li>\n<li>- Added comment pagination to single blog post template</li>\n<li>- Minor additions to style.css to suit new changes</li>\n</ul>\n<br>\n<h4>Version 2.1</h4>\n<ul>\n<li>- Updated image resizing script (thumbnails now only get created as needed)</li>\n<li>- Minor CSS adjustments/bug fixes</li>\n<li>- Added upgrade notifier (you will now be notified via the wordpress dashboard when new karma releases are available)</li>\n<li>- Cleaned up the code throughout, leaner, more optimized code</li>\n<li>- Optimized images and reduced filesizes</li>\n<li>- Added ''featured video'' functionality to blog</li>\n<li>- Fixed "Default Template" (this is now the regular full width template.)</li>\n<li>- Added powerful logo builder</li>\n<li>- Added 16x16 social icons for top toolbar</li>\n</ul>\n]]>\n	</changelog>\n</notifier>', 'yes'),
