(76867, 'wpmembers_email_repass', 'a:2:{s:4:"subj";s:48:"Blanqueo de contraseña para el Sitio [blogname]";s:4:"body";s:602:"Su contraseña de accceso a [blogname] ha sido blanqueada.\r\n\r\nHemos generado una nueva contraseña que se encuentra debajo.\r\n\r\npassword: [password]\r\n\r\nRecomendamos encarecidamente que cambie ésta contraseña cuando ingrese al sitio por una que sea más facil de recordar para ud. Puede hacerlo dirigiendose a [members-area]\r\n\r\nCONSEJO: Una forma facil y segura de hacerlo es utilizar letras mayusculas y minusculas junto con al menos 4 números (en lo posible que no seán consecutivos), de ésta forma: NoMbRe2014\r\nEs recomendable también que se componga de no menos de 8 caracteres y no más de 16.";}', 'yes'),
(76868, 'wpmembers_email_notify', 'a:2:{s:4:"subj";s:39:"Nuevo registro de Usuario en [blogname]";s:4:"body";s:245:"Se ha registrado un nuevo usuario en [blogname]:\r\n	\r\nNombre de Usuario: [username]\r\nemail: [email]\r\n\r\n[fields]\r\nel usuario se registró aquí:\r\n[reglink]\r\n\r\nIP del Usuario: [user-ip]\r\n	\r\nActive éste usuario desde éste enlace: [activate-user]\r\n";}', 'yes'),
