(76862, 'wpmembers_dialogs', 'a:9:{i:0;s:204:"Éste contenido está reservado solo para usuarios con cierto nivel de acceso.  Si ud. ya se encuentra registrado para ésta sección, por favor identifíquese, si no lo estáa, puede hacerlo desde aquí.";i:1;s:91:"Lo sentimos, éste nombre de usuario ya está en uso, le aconsejamos intentarlo nuevamente.";i:2;s:134:"Disculpe, pero ésta dirección de correo ya se encuentra registrada.<br />intente recuperar su contraseña o utilice otra dirección.";i:3;s:220:"Felicitaciones! ha completado el proceso de registro correctamente.<br /><br />Podrá acceder luego que reciba la confirmación de ss datos utilizando la contraseña elegida  junto con los datos le enviaremos por e-mail.";i:4;s:36:"Su información ha sido actualizada!";i:5;s:65:"Las contraseñas no concuerdan.<br /><br />inténtelo nuevamente.";i:6;s:46:"La contraseña ha sido cambiada correctamente!";i:7;s:69:"El usuario o email ingresados no se encuentran en nuestros registros.";i:8;s:156:"La contraseña ha sido blanqueada!<br /><br />Un email ha sido enviado a la cuenta que figura en nuestro sistema con los nuevos datos para acceder al sitio.";}', 'yes'),
