(76864, 'wpmembers_email_newreg', 'a:2:{s:4:"subj";s:37:"Your registration info for [blogname]";s:4:"body";s:268:"Thank you for registering for [blogname]\r\n\r\nYour registration information is below.\r\nYou may wish to retain a copy for your records.\r\n\r\nusername: [username]\r\npassword: [password]\r\n\r\nYou may login here:\r\n[reglink]\r\n\r\nYou may change your password here:\r\n[members-area]\r\n";}', 'yes'),
(76865, 'wpmembers_email_newmod', 'a:2:{s:4:"subj";s:37:"Gracias por registrarse en [blogname]";s:4:"body";s:373:"Gracias por registrarse en [blogname]. \r\nsu registro ha sido enviado y está pendiente de aprobación.\r\nud recibirá un mensaje con la confirmación de su registro y los datos de acceso a su cuenta para podeer completar sus datos y ampliar su información en el sitio.\r\nUna vez que se haya identificado en el sitio será capaz de acceder al contenido especial de nuestro.\r\n";}', 'yes'),
(76866, 'wpmembers_email_appmod', 'a:2:{s:4:"subj";s:42:"Su registro en [blogname] ha sido aprobado";s:4:"body";s:377:"Su registro en [blogname] ha sido aprobado.\r\n\r\nSus datos de registro son los siguientes.\r\nAconsejamos que guarde éste mensaje por cualquier inconveniente.\r\n\r\nUsuario: [username]\r\nContraseña: [password]\r\n\r\nPuedes ingresar para modificar o ampliar tus datos desde el siguiente enlace:\r\n[members-area]\r\n\r\nUd. se registro inicialmente para acceder a éste contenido:\r\n[reglink]\r\n";}', 'yes'),
