(4326, 615, '_feedback_all_fields', 'a:22:{s:6:"Nombre";s:18:"rut silvina guzman";s:10:"Dirección";s:30:"200 esquina 3 (parque hermoso)";s:5:"Email";s:0:"";s:17:"Teléfono/Celular";s:10:"2235130165";s:14:"Salir de Deuda";s:0:"";s:29:"Aumento de Ingreso Económico";s:0:"";s:28:"Ser sanado de una Enfermedad";s:3:"Sí";s:16:"Matrimonio Feliz";s:0:"";s:25:"Ser libre de Algún vicio";s:0:"";s:27:"Cosas trabadas que no salen";s:3:"Sí";s:28:"Ser Libre de alguna opresion";s:0:"";s:21:"Por alguien en drogas";s:3:"Sí";s:19:"Un familiar enfermo";s:0:"";s:20:"Problemas Familiares";s:3:"Sí";s:18:"Un ascenso laboral";s:0:"";s:18:"Por una Injusticia";s:0:"";s:31:"Soledad / Depresion / Desánimo";s:3:"Sí";s:12:"Por un Amigo";s:0:"";s:20:"Por un bien material";s:0:"";s:24:"Por un Exámen o Materia";s:0:"";s:15:"Otro no Listado";s:0:"";s:35:"Por favor, describinos su petición";s:752:"Hola tenemos un taxi q se vive rompiendo,no podemos progresar para poder construir nuestra casa....tengo un hermano en las drogas y ahora esta en la calle he averiguado para internarlo y ponen trabas xk es mayor y tiene q tener voluntad de internarce solo... tengo un hijo q no se ocupa de sus hijo y se acaba de juntar con una chica embaraazaba y con una nena de 2 años... ya tubo familia y le puso su apellido... duscuti mucho con el x mis nietos de sangre... esta muy tomado x el enemigo... fue bautizado y dice ahora q no quiere saber nada de dios....y yo con todos mis problemas sufro de ataque de pánico no estoy medicada y mi cuerpo se esta deteriorando x dentro.....encomiendo mi vida a dios...y se q la oración es poderosa .... bendiciones ";}'),
