(4328, 615, '_feedback_akismet_values', 'a:50:{s:14:"comment_author";s:18:"rut silvina guzman";s:20:"comment_author_email";s:0:"";s:18:"comment_author_url";s:0:"";s:20:"contact_form_subject";s:15:"Troquel Virtual";s:17:"comment_author_IP";s:14:"200.49.206.196";s:15:"comment_content";s:751:"Hola tenemos un taxi q se vive rompiendo,no podemos progresar para poder construir nuestra casa....tengo un hermano en las drogas y ahora esta en la calle he averiguado para internarlo y ponen trabas xk es mayor y tiene q tener voluntad de internarce solo... tengo un hijo q no se ocupa de sus hijo y se acaba de juntar con una chica embaraazaba y con una nena de 2 años... ya tubo familia y le puso su apellido... duscuti mucho con el x mis nietos de sangre... esta muy tomado x el enemigo... fue bautizado y dice ahora q no quiere saber nada de dios....y yo con todos mis problemas sufro de ataque de pánico no estoy medicada y mi cuerpo se esta deteriorando x dentro.....encomiendo mi vida a dios...y se q la oración es poderosa .... bendiciones";s:12:"comment_type";s:12:"contact_form";s:7:"user_ip";s:14:"200.49.206.196";s:10:"user_agent";s:153:"Mozilla/5.0 (Linux; Android 4.1.1; ALCATEL ONE TOUCH 6030A Build/JRO03C) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/34.0.1847.114 Mobile Safari/537.36";s:8:"referrer";s:44:"http://www.puertadevida.com/troquel-virtual/";s:4:"blog";s:27:"http://www.puertadevida.com";s:15:"SERVER_SOFTWARE";s:6:"Apache";s:11:"REQUEST_URI";s:17:"/troquel-virtual/";s:14:"CONTENT_LENGTH";s:4:"1605";s:12:"CONTENT_TYPE";s:33:"application/x-www-form-urlencoded";s:13:"DOCUMENT_ROOT";s:27:"/home3/jorgesch/public_html";s:17:"GATEWAY_INTERFACE";s:7:"CGI/1.1";s:11:"HTTP_ACCEPT";s:74:"text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,*/*;q=0.8";s:20:"HTTP_ACCEPT_ENCODING";s:17:"gzip,deflate,sdch";s:20:"HTTP_ACCEPT_LANGUAGE";s:15:"es-419,es;q=0.8";s:18:"HTTP_CACHE_CONTROL";s:9:"max-age=0";s:15:"HTTP_CONNECTION";s:2:"TE";s:9:"HTTP_HOST";s:20:"www.puertadevida.com