(4329, 615, '_feedback_email', 'a:4:{s:2:"to";s:30:"luciano_schmarsow@yahoo.com.ar";s:7:"subject";s:15:"Troquel Virtual";s:7:"message";s:1117:"Nombre : rut silvina guzman \n\nDirección: 200 esquina 3 (parque hermoso)\n\nTeléfono/Celular: 2235130165\n\nSer sanado de una Enfermedad: Sí\n\nCosas trabadas que no salen: Sí\n\nPor alguien en drogas: Sí\n\nProblemas Familiares: Sí\n\nSoledad / Depresion / Desánimo: Sí\n\nPor favor, describinos su petición : Hola tenemos un taxi q se vive rompiendo,no podemos progresar para poder construir nuestra casa....tengo un hermano en las drogas y ahora esta en la calle he averiguado para internarlo y ponen trabas xk es mayor y tiene q tener voluntad de internarce solo... tengo un hijo q no se ocupa de sus hijo y se acaba de juntar con una chica embaraazaba y con una nena de 2 años... ya tubo familia y le puso su apellido... duscuti mucho con el x mis nietos de sangre... esta muy tomado x el enemigo... fue bautizado y dice ahora q no quiere saber nada de dios....y yo con todos mis problemas sufro de ataque de pánico no estoy medicada y mi cuerpo se esta deteriorando x dentro.....encomiendo mi vida a dios...y se q la oración es poderosa .... bendiciones \n\n\nMessage was sent on Miércoles abril 30, 2014 at 1:01 pm\n";s:7:"headers";s:82:"From: rut silvina guzman <>\r\nReply-To: \r\nContent-Type: text/plain; charset="UTF-8"";}'),
