(6064, 780, '_feedback_akismet_values', 'a:47:{s:14:"comment_author";s:19:"cristian hermosilla";s:20:"comment_author_email";s:33:"cristian-gonzalo.h@hotmail.com.ar";s:18:"comment_author_url";s:0:"";s:20:"contact_form_subject";s:36:"[Ministerio Puerta de Vida] Contacto";s:17:"comment_author_IP";s:12:"83.41.14.230";s:15:"comment_content";s:1097:"hola pastores..!aki estioy comentadoles que pase muchas cosas aki..no es lo que todos cuentan y piensan..la mujer que me trajo me estafo y no cumplio con nada de lo que me dijo y tuve que salir con mis maletas a buscarme la vida..por suerte un amigo argentino que hace 10 años no veia me dio una mano y me dio de comer durante una semana y me dejo dormir en su sofa..hasta que consegui trabajo en una peluuqueria y el dueño en una semana me ofrecio un local pekeño para alquilar y ahi estoy ahora..y consegui un mejor piso para alkilar con terraza y balcon muy lindo....como siempre mi fe en dios esta intacta..eso me da muchas fuerzas..nunca me olvido de ustedes y sus palabras.siempre los llevo en mi corazon..por favor dele saludos mios a la gente de la iglesia..!!nose cuando podre volver..porque ahora no es cmo antes esta dificil juntar dinero..por la crisis que ahi aki..y todabia estoy ilegal..pero siempre antes de salir a la calle le pido a dios a dios y los angeles que me guarden y me protegan y me siento muy seguro..un abrazo grande..los kiero mucho...=)..atte cristian hermosilla";s:12:"comment_type";s:12:"contact_form";s:7:"user_ip";s:12:"83.41.14.230";s:10:"user_agent";s:109:"Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/37.0.2062.124 Safari/537.36";s:8:"referrer";s:37:"http://www.puertadevida.com/contacto/";s:4:"blog";s:27:"http://www.puertadevida.com";s:15:"SERVER_SOFTWARE";s:6:"Apache";s:11:"REQUEST_URI";s:10:"/contacto/";s:14:"CONTENT_LENGTH";s:4:"1649";s:12:"CONTENT_TYPE";s:33:"application/x-www-form-urlencoded";s:13:"DOCUMENT_ROOT";s:27:"/home3/jorgesch/public_html";s:17:"GATEWAY_INTER