(6065, 780, '_feedback_email', 'a:4:{s:2:"to";a:1:{i:0;s:30:"luciano_schmarsow@yahoo.com.ar";}s:7:"subject";s:36:"[Ministerio Puerta de Vida] Contacto";s:7:"message";s:1245:"Nombre : cristian hermosilla \n\nEmail : cristian-gonzalo.h@hotmail.com.ar \n\nSu Mensaje : hola pastores..!aki estioy comentadoles que pase muchas cosas aki..no es lo que todos cuentan y piensan..la mujer que me trajo me estafo y no cumplio con nada de lo que me dijo y tuve que salir con mis maletas a buscarme la vida..por suerte un amigo argentino que hace 10 años no veia me dio una mano y me dio de comer durante una semana y me dejo dormir en su sofa..hasta que consegui trabajo en una peluuqueria y el dueño en una semana me ofrecio un local pekeño para alquilar y ahi estoy ahora..y consegui un mejor piso para alkilar con terraza y balcon muy lindo....como siempre mi fe en dios esta intacta..eso me da muchas fuerzas..nunca me olvido de ustedes y sus palabras.siempre los llevo en mi corazon..por favor dele saludos mios a la gente de la iglesia..!!nose cuando podre volver..porque ahora no es cmo antes esta dificil juntar dinero..por la crisis que ahi aki..y todabia estoy ilegal..pero siempre antes de salir a la calle le pido a dios a dios y los angeles que me guarden y me protegan y me siento muy seguro..un abrazo grande..los kiero mucho...=)..atte cristian hermosilla \n\n\nMessage was sent on Martes noviembre 4, 2014 at 6:32 pm\n";s:7:"headers";s:149:"From: cristian hermosilla <cristian-gonzalo.h@hotmail.com.ar>\r\nReply-To: cristian-gonzalo.h@hotmail.com.ar\r\nContent-Type: text/plain; charset="UTF-8"";}'),
