(7433, 1004, '_feedback_all_fields', 'a:3:{s:6:"Nombre";s:11:"maria jose ";s:5:"Email";s:26:"cristaldoisidora@gmail.com";s:10:"Su Mensaje";s:753:"Pastor schmarsow : Hola mi nombre es Maria Jose , tengo 28 años . El motivo de ste mensaje es pedirle oración por mi vida , tengo 10 años padeciendo ataques de pánico a causa del bullying y golpizas que me daban en mi colegio . Estoy cansada de padecer este problema , se que yendo a la iglesia se solucionaria pero a veces ni siquiera puedo salir de mi casa . Miro sus videos y 2 veces fui al culto pero por vergüenza no pude pedirle ayuda personalmente . por favor ore por mi para que pueda ser libre y volver a ser como antes . mi mayor sueño es terminar de estudiar pero asi no puedo . gracias por leerme . mi mail que figura aquí es el de mi madre , si usted pudiera qusiera me un consejo . gracias por leer este mensaje . Dios lo bendiga :)";}'),
