(25, 11, '2013-10-08 21:03:12', '2013-10-09 00:03:12', '<h2>Clase 1 - Juan 3:1-21</h2>\r\nNicodemo nunca se imaginó que al visitar a Jesús se vería confrontado con una necesidad fundamental para poder entrar al reino de los cielos, <b>NACER DE NUEVO.</b>\r\n\r\n<!--more-->\r\n\r\nA la vista de cualquier humano tenía todas las buenas cosas que se requiere para vivir bien delante de Dios, pero a la mirada de Jesucristo la faltaba algo, el nuevo nacimiento, conocía la religión, tenía una buena moral y era una persona respetada, sin embargo no había tenido la experiencia de una relación personal con Jesucristo.\r\n\r\nCuando tú decidiste recibir a Jesucristo en tu corazón en ese mismo momento sucedió algo maravilloso\r\n\r\n<b> </b>\r\n\r\n<b>NACISTE DE NUEVO ESPIRITUALMENTE – 2 Corintios 5:17 - ATENCIÓN</b>\r\n\r\nEl nacer de nuevo no lo da la posición social, ni la buena moral, ni ninguna otra forma de esfuerzo humano, pues es sólo a través de creer y recibir el perdón de pecados por medio de Jesucristo\r\n\r\n<b><i>(Hechos 10:43, Romanos 5:1)</i></b>\r\n\r\nNo debes olvidar que desde el momento de recibir a Jesucristo naciste de nuevo y te convertiste en un <b>BEBE ESPIRITUAL</b> y sabemos que un bebé cuando llega a una familia trae alegría y es hermoso, pero todo mundo espera que ese bebe crezca. De la misma manera Dios espera que crezcas en tu nueva vida y llegues a ser maduro espiritualmente hablando.\r\n\r\n¿Cómo puedes lograr ese crecimiento?\r\n\r\n<b>1.      </b><b>ALIMENTÁNDOTE A DIARIO CON LA PALABRA DE DIOS.</b>\r\n\r\n<b>Lee 1 Pedro 2:2.</b>\r\n\r\nLa Biblia es el más grande de los tesoros, en ella encontramos todos los principios para vivir en victoria y las respuestas a nuestras necesidades, no necesitas sólo información sino que las verdades bíblicas penetren en tu corazón y ejerzan un cambio de conducta.\r\n\r\n<b>2.      </b><b>HABLANDO CON DIOS TODOS LOS DÍAS.</b>\r\n\r\n<b>Lee Salmos 5:1-3.</b>\r\n\r\nOrar no es rezar, es decir, repetir frases por costumbre, orar es platicar con Jesús como lo harías con un amigo, la oración hace que las cosas sucedan y debes saber que Dios está contigo continuamente, dirígele la palabra en acción de gracias y luego pidiéndole que te ayude en todas las cosas.\r\n\r\nProponte diariamente platicar con Dios.\r\n\r\n<b>3.      </b><b>REUNIÉNDOTE CONSTANTEMENTE CON OTROS CRISTIANOS.</b>\r\n\r\n<b>Lee Hebreos 10:25</b>\r\n\r\nCuando colocas un trozo de leña en el fuego éste se encenderá y se mantendrá ardiendo, pero si lo quitas del fuego se apaga. De la misma manera puedes mantener el fuego de tu nueva vida o apagarlo.\r\n\r\nPor esta razón es muy importante que inmediatamente empieces a reunirte en un <b>HOGAR DE REFUGIO</b> y que asistas los días domingos de celebración en el Ministerio Puerta de vida, la persona que te invitó o que está dándote esta clase puede ayudarte. El cometer errores o pasar por problemas puede traerte desánimos pero no debes desistir, por eso necesitas ir a la iglesia, allí disfrutaras de Su Presencia, escucharás mensajes y enseñanzas que transformarán tu vida. El deseo de Dios es que permanezcas fiel en sus sendas, si lo haces la bendición no se hará esperar, tocará tu vida, tu familia y verás la mano de Dios sobre ti.\r\n\r\nDescargue ésta clase en Formato PDF para Imprimir', 'Discipulado 1-1 - Que ha Pasado en Mi', 'Nicodemo nunca se imaginó que al visitar a Jesús se vería confrontado con una necesidad fundamental para poder entrar al reino de los cielos, NACER DE NUEVO.', 'publish', 'closed', 'open', '', 'discipulado-1-1-que-ha-pasado-en-mi', '', '', '2014-11-11 07:51:26', '2014-11-11 10:51:26', '', 0, 'http://www.puertadevida.com/?p=25', 4, 'post', '', 0),
(6, 5, '2013-10-08 20:50:44', '2013-10-08 23:50:44', '[video_left][video_frame]\r\n\r\n[iframe url="http://www.ustream.tv/embed/100770?html5ui" width="570" height="312"]\r\n\r\n&nbsp;\r\n<h3>Vea los mensajes Anteriores en <strong><a href="https://www.ustream.tv/channel/Jes%C3%BAs-Puerta-de-Vida---Mar-del-Plata">Nuestro Canal</a></strong></h3>\r\n[/video_frame]\r\n[/video_left]\r\n[one_third_last]\r\n<h5><strong>ESTÁMOS ORANDO POR USTED</strong></h5>\r\ndéjenos su petición y nos pondrémos en contacto.\r\n[frame style="shadow" image_path="http://www.puertadevida.com/archivos/2014/04/Invasion-el-dia-despuesPagina.jpg" link_to_page="http://www.puertadevida.com/troquel-virtual/" target="_self" description="Déjenos su petición, Estamos orando por Usted" float="" lightbox="" lightbox_group="" size="three_col_large"]\r\n<p style="text-align: center;">[button url="http://www.puertadevida.com/troquel-virtual/" target="_self" size="small" icon="" popup="" title="" style="cherry"]Complete el <b>TROQUEL VIRTUAL</b>[/button][/one_third_last]</p>\r\n[hr]\r\n<h2>La gran Comisión: <strong>ORAR y GANAR</strong></h2>\r\n[one_third]\r\n\r\n[embed]http://www.puertadevida.com/audio/martes20150728.mp3[/embed]\r\n[hr]\r\n<p style="text-align: center;">[button url="http://www.puertadevida.com/audio/martes20150728.mp3" target="_blank" size="medium" style="limegreen" icon="" popup="" title="Descargar Archivo"]Descargar Archivo[/button]</p>\r\n[/one_third]\r\n[two_thirds_last]\r\n<h4>El Señor nos envió a GANAR... a hacer discípulos a las naciones. Parte de ésta tarea se realiza, primero ORANDO. La explicación completa de como debemos realizar el trabajo se enseño a los servidores en nuestro ministerio.</h4>\r\n<h4>Puede escuchar la charla completa desde el reproductor en ésta página o descargar el archivo a su equipo pulsando con el botón derecho del mouse sobre "Descargar Archivo" y seleccionando "Guardar enlace" o "Guardar destino de enlace"</h4>\r\n.\r\n\r\n[/two_thirds_last]\r\n\r\n[hr][bl