r\n	<li>Creemos en el bautismo en aguas en el nombre del Padre, del Hijo y del Espíritu Santo como confesión del señorío de Cristo. (Mateo 28:19, Hech 2:38-41, Marcos 1:5, Juan 3:23-)</li>\r\n	<li>Creemos en la impartición de bendiciones, consagración y dones por medio de la imposición de manos. (1 Tim 4:14, Heb 6:2, Mateo 8:3, Hechos 13:1-4)</li>\r\n	<li>Creemos en el juicio eterno. (Rom 14:1-12, Mt 12:36-37, Ap 22:12, 2 Cor 5:10)</li>\r\n	<li>Creemos en que sólo a través de Jesucristo hay salvación. (Hch. 4:11-12, 1 Tim. 2:5)</li>\r\n	<li>Creemos en que la Santa Cena simboliza el sacrificio de Cristo en la cruz, herido por nuestros pecados. (1 Co. 11:24-25)</li>\r\n	<li>Creemos que la Iglesia de Jesucristo debe vivir en salud, prosperidad, autoridad, señorío y disfrutar de la herencia que Dios ha dejado para una vida en victoria. (Rom 8:35-39, Col. 1:9-13, Ef. 1:17-18)</li>\r\n	<li>Creemos que el Espíritu Santo es el que nos santifica y nos guía. ( Jn. 16:7-15)</li>\r\n	<li>Creemos en la solemnidad del casamiento porque es instituido por Dios y sancionado por el Señor en la Cena de Galilea y se asemeja a la unión con Cristo y su Iglesia. (Ef. 5:33)</li>\r\n	<li>Creemos en la presentación de los niños al Señor para implorar sus bendiciones sobre ellos. (Mt. 19:13-15, Lc. 2:22-24, Mr 10:13)</li>\r\n	<li>Creemos en las dos resurrecciones, tanto la de los justos, como la de los injustos, para recompensar según sus obras. (Jn. 5:24-29, 1 Co. 15:20-25)</li>\r\n	<li>Creemos en el deber de pagar los diezmos y también traer ofrendas al Señor para identificarnos como hijos de Dios, según las promesas de Abraham.  (Gal. 3:6-9, Heb. 7:4-9)</li>\r\n	<li>Creemos en la santificación del creyente en Cristo durante su vida terrenal para entrar al Reino de Dios. (1 P. 1:15-16, Heb. 12:14-16)</li>\r\n	<li>Creemos que por medio de la oración de fe, el Señor sanará al enfermo.(Mr. 16:18, Stg. 5:15-16)</li>\r\n	<li>Creemos en el culto de adoración a Dios con toda reverencia. (Jn. 4:22-24, Rom. 14:11, Salm 35:27, Salm 22:2 Hech 2:46-47)</li>\r\n	<li>Creemos en la relación del hombre con Dios por la oración, mediante la intercesión de nuestro Señor Jesucristo. (1 Tim. 2:5, Jn. 14:13-14)</li>\r\n	<li>Creemos en los ayunos y vigilias como medio de consagración. (Hch. 13:2, Lc. 6:12)</li>\r\n	<li>Creemos en las profecías de Dios, de acuerdo con Su Palabra, desechando todo fanatismo y cosa que no se ajuste a la sana doctrina. (1 Cor 14:1-3, 1 Jn. 4:1, 1 Tim. 4:1-2)</li>\r\n	<li>Creemos que los hermanos deben amarse, nunca acusarse, pues el que acusa es el Diablo. (Jn. 17:21-26, Ap. 12:10, 1 Jn. 2:9)</li>\r\n	<li>Creemos que el que peca voluntariamente  puede llegar a perder su salvación si no se arrepiente. (2 Tes 2:3, 1 Tim 4:1, Mateo 7:16-20, Rom 6:11-23) en este sentido no se refiere al tropiezo del cristiano ante una debilidad, el desanimo producido por una crisis o el alejamiento momentáneo de la congregación sino al nivel de Apostasía que es la renuncia total, negación o abandono voluntario de la fe en Cristo.</li>\r\n	<li>Creemos que la gracia de Dios nos cubre en nuestras debilidades, mientras libramos la victoria (Hech 10:29-32, 2 Cor 12:9)</li>\r\n	<li>Creemos que la iglesia esta llamada a levantar, ayudar, consolar, perdonar, y no a juzgar, ni maltratar (2 Cor 5:14-20, 1 Tes 4:18)</li>\r\n	<li>Creemos en la ley de la fe y no de las obras (Rom 3:21-25, 2 Cor 5:7, Rom 4:17)</li>\r\n	<li>Creemos que la virgen María concibió por la obra del Espíritu Santo y dio a luz a Jesucristo y este fue su hijo primogénito, pero</li>\r\n	<li>Jesucristo es el único salvador de las almas (1 Tim 2:5, Gal 4:1-7)</li>\r\n	<li>Creemos que la cruz es el memorial del nuevo pacto y literalmente donde el Señor Jesucristo fue ajusticiado humanamente por nuestros pecados y también la figura de las persecuciones que debe pasar el cristiano por causa de la fe. Pero ninguna adoración puede dársela a la cruz por que es en contra del mandamiento bíblico (Lucas 14:27, Mr 8:34)</li>\r\n</ul>\r\n<h2>Visión y Misión</h2>\r\nVisión :Establecer el reino de Dios en nuestra familia, barrio, Ciudad y Nación\r\nCuando hablamos de la VISIÓN se hace referencia a un pensamiento de largo plazo sobre lo que se quiere lograr.\r\n\r\nMisión: Orar – Ganar – Consolidar – Discipular - Enviar\r\nCuando hablamos de la MISIÓN nos referimos a la precisión sobre lo que hay que hacer para lograr desarrollar la VISIÓN, es decir, cómo empleamos y mezclamos los recursos de la MISIÓN para cumplir con la visión señalada como propósito.\r\n\r\n[notify_box style="blue"]Una visión compartida no es una idea, es una fuerza en el corazón de la gente,\r\n\r\nuna fuerza de impresionante poder, y pocas fuerzas humanas son tan poderosas\r\ncomo una visión compartida[/notify_box]\r\n\r\n[testimonial_wrap]\r\n[testimonial]¿No decís vosotros:  Aún faltan cuatro meses para que llegue la siega?  He aquí os digo:  Alzad vuestros ojos y mirad los campos,  porque ya están blancos para la siega.[client_name]Juan 4:35[/client_name][/testimonial]\r\n[/testimonial_wrap]\r\n\r\nJesús miró la cosecha a través de los siglos. Hablo de lo que para Él era presente. Dio un ejemplo con algo práctico, común para esos días como lo era la cosecha en los campos de Israel. Mostró la necesidad de estar preparados para la cosecha, tanto el dueño del campo como los que habrían de cosechar.\r\n\r\nLa Misión es la definición de que hay hacer para lograr el objetivo.\r\nLucas 10:2  Y les decía:  La mies a la verdad es mucha,  más los obreros pocos;  por tanto,  rogad al Señor de la mies que envíe obreros a su mies.\r\n\r\nSin visión no hay misión... Sin visión no hay rumbo, entonces el fin es la esclavitud.\r\n\r\nHoy Dios nos da la misma palabra que a sus discípulos en aquel tiempo... La cosecha esta lista.', 'Conózcanos', '', 'publish', 'closed', 'closed', '', 'acerca-de', '', '', '2016-01-06 22:25:52', '2016-01-07 01:25:52', '', 0, 'http://www.puertadevida.com/?page_id=12', 0, 'page', '', 0);
