(27, 11, '2013-10-08 21:05:19', '2013-10-09 00:05:19', '<h2>Clase 2 - Lucas 8:4-15</h2>\r\nTu vida nueva en Cristo requiere de fundamentos y convicción para poder enfrentar las diferentes opiniones de aquellos que ahora saben de tu cambio de vida y no lo entienden, también de los obstáculos y desafíos que te esperan por delante en tu caminar con Dios.\r\n\r\n<!--more-->\r\n\r\nJesús enseña sobre el sembrador que Él mismo es y sobre la semilla que es la palabra de fe que entró en nosotros y produjo el nacer de nuevo, también de cuatro clases de tierra que son las diferentes decisiones del corazón del que recibió a Cristo un día. Veamos las diferentes decisiones:\r\n\r\n<b>1. V12</b> – Son aquellos que las ataduras espirituales que el diablo les tendió no les permiten permanecer a causa de la falta de fe, entran en duda y tienden a cuestionar todo en un ambiente de escepticismo, para ellos es importante lo que los demás piensen y hacen caso a las críticas y opiniones de amigos, familiares o terceras personas, terminan en perder lo que Dios les había regalado, su libertad y salvación.\r\n\r\n<b>2. V13 </b>– Son aquellos que al recibir a Cristo creen que la felicidad les llegó y todos sus problemas se terminaron como si hubiesen ganado una especie de lotería, tienden a creer que Dios es una especie de supermercado que sólo está para consentir sus deseos y caprichos. Cuando la prueba llega para ver y pesar sus corazones acerca de su amor por el Señor, se apartan hasta enfriarse, terminan en tristemente perder todo lo que Dios les había dado, la verdadera paz y salvación.\r\n\r\n<b>3. V14 </b>– Son aquellos que no crecen en la fe a causa de los afanes de la vida, su enfoque está sólo en tener cosas materiales, placer y diversión. Por un tiempo caminan con Dios pero pronto tomarán la senda equivocada hacia las cosas de este mundo, todo terminará en una lejana experiencia de algún día haber conocido a Dios, pierden las más ricas bendiciones del cielo y su salvación.\r\n\r\n<b>4. V15</b> – Son Aquellos que nacieron de nuevo y cuidaron de su salvación, permaneciendo en la fe de Cristo Jesús, no temen ni obedecen a las críticas y opiniones de los demás, saben que Dios está con ellos en toda circunstancia y pelean la batalla de la fe, deciden poner sus ojos en el cielo y no en las cosas de la tierra, son conocidos por su apasionado deseo de conocer a Dios, el destino de ellos está sellado en bendición espiritual, familiar y material, disfrutan de la vida eterna.\r\n\r\n<b>¿QUÉ CLASE DE TIERRA QUIERES SER TÚ?</b>\r\n\r\nHoy puedes hacer una oración de compromiso a Dios decidiendo ser buena tierra, para siempre caminar en sus sendas y ser lo que Dios está esperando de ti, sin importar lo que tengas que hacer o enfrentar, con toda seguridad debes saber que al hacerlo el cielo estará siempre abierto para ti. El Señor te bendiga en todo siempre. Felicidades y camina fielmente.\r\n\r\nDescargar ésta clase en formato PDF para Imprimir', 'Discipulado 1-2 - Mi Vida Social', 'Tu vida nueva en Cristo requiere de fundamentos y convicción para poder enfrentar las diferentes opiniones de aquellos que ahora saben de tu cambio de vida y no lo entienden, también de los obstáculos y desafíos que te esperan por delante en tu caminar con Dios.', 'publish', 'closed', 'open', '', 'd102-mi-vida-social', '', '', '2014-11-11 07:51:12', '2014-11-11 10:51:12', '', 0, 'http://www.puertadevida.com/?p=27', 5, 'post', '', 0),
(31, 11, '2013-10-08 21:12:28', '2013-10-09 00:12:28', '<h2>Clase 3</h2>\r\nEn nuestra vida cristiana los problemas se convierten en desafíos cuando vivimos una relación de intimidad y amistad con Cristo Jesús, de manera que nos mantiene protegidos. Mientras más cerca estemos del Señor más seguros estaremos.\r\n\r\n<!--more-->\r\n\r\nQué hermoso es saber que Jesucristo vive dentro de cada verdadero creyente, qué hermoso es saber que ahora vive en ti, pero ¿qué valor tiene esto?\r\n<ol>\r\n	<li>Tienes vida eterna <b><i>(Romanos 6:22-23)</i></b></li>\r\n	<li>Nos libró de las garras del diablo <b><i>(Colosenses 1:13)</i></b></li>\r\n	<li>Tiene cuidado de ti <b><i>(1 Pedro 5:7)</i></b></li>\r\n</ol>\r\n<b>DEBES ENTENDER ESTO</b>\r\n\r\n<b>La vida cristiana no es un sistema en el cual vivimos para Dios, sino que DIOS VIVE EN NOSOTROS<i>. (2 Corintios 13:5)</i></b>\r\n\r\nHabrá ocasiones en que NO SENTIRÁS que lo que ha sucedido en tu vida con Cristo sea una realidad, pero es ahí donde debes entender que tu relación con Dios no es en base a lo que sientes, sino a la certeza de la realidad de que Dios te llamó y está en ti desde que decidiste creer y caminar con Él.\r\n\r\n<b>RECUERDA ESTO</b>\r\n<ol>\r\n	<li>El diablo intentará hacerte pecar a través de las tentaciones y por lo tanto debes vencerlas y no pecar más, recuerda que ser tentado no es pecado, ceder a tus deseos antiguos que te controlaban es pecar.\r\n<b><i>(1 Pedro 5:8-9)</i></b> Dios ofrece ayudarte a resistir y huir del pecado <b><i>(1 Corintios 10:12-13)</i></b>.</li>\r\n	<li>Habla con Dios diariamente y confía y encomienda todo a Él, en agradecimiento por cuánto te ama.</li>\r\n	<li>Sigue asistiendo a la iglesia fielmente, pues ahí serás fortalecido con la Palabra y tendrás oportunidad de sentir Su presencia en la adoración.</li>\r\n	<li>Asiste a tu hogar de refugio, allí conocerás más de Su Palabra, pues ir sólo el domingo no es suficiente para mantener tu fuego encendido.</li>\r\n	<li><b><span style="text-decoration: underline;">Te invitamos al próximo Encuentro CARA A CARA.</span></b> La persona que te da esta clase puede darte más información y ayudarte.</li>\r\n</ol>\r\n&nbsp;\r\n\r\nHaciendo esto crecerás en tu relación con Dios y cumplirás con sus propósitos en tu vida.\r\n\r\nEl Señor te siga enamorando más de Él día a día.\r\n\r\nDescargue ésta clase en formato PDF para imprimir', 'Discipulado 1-3 - Mi relacion diaria con Jesucristo', 'En nuestra vida cristiana los problemas se convierten en desafíos cuando vivimos una relación de intimidad y amistad con Cristo Jesús, de manera que nos mantiene protegidos. Mientras más cerca estemos del Señor más seguros estaremos.', 'publish', 'closed', 'open', '', 'd103-mi-relacion-con-cristo', '', '', '2014-11-11 07:50:56', '2014-11-11 10:50:56', '', 0, 'http://www.puertadevida.com/?p=31', 6, 'post', '', 0),
(33, 11, '2013-10-08 21:14:26', '2013-10-09 00:14:26', '<h2>Clase 4</h2>\r\n¿Qué hacemos con una persona que ha muerto? ¡Lo enterramos! ¡Es la única manera de tratar con un muerto! La Biblia dice que hemos muerto al pecado cuando permitimos que Jesucristo entre a nuestro corazón. <b><i>(Romanos 6:11, Colosenses 2:12).</i></b>\r\n\r\n<!--more-->\r\n\r\nEn el bautismo enterramos simbólicamente nuestra vieja vida de pecado, el bautismo no produce la muerte de la vieja naturaleza, sino que es la evidencia exterior de que la muerte del viejo hombre ya se ha realizado. No enterramos a alguien para causarle la muerte, sino que la persona ya tiene que estar muerta.\r\n\r\n<b>¿QUÉ ES EL BAUTISMO?</b>\r\n\r\nLa palabra bautismo viene del griego “baptizo” que significa sumergir, anegar, cubrir por completo, esta palabra también se usa para referirse al acto de teñir telas, ya que deben ser sumergidas completamente en la tintura que le daría el nuevo color. Este es el bautismo que Jesús nos enseña, de hecho Jesús fue bautizado en el Río Jordán por medio de la inmersión total de su cuerpo a los 30 años. Mateo 3:13-17.\r\n\r\nEl bautismo es el símbolo de la muerte, sepultura y resurrección, cuando la persona es sumergida está enterrando su antigua vida y cuando sale de las aguas está resucitando a una nueva vida, como lo hizo nuestro Señor Jesucristo, de esta manera el nuevo creyente sella la fe en su corazón. El bautismo no salva, sino sólo la fe en Jesucristo.\r\n\r\n<b>¿QUIÉN SE PUEDE BAUTIZAR?</b>\r\n\r\n<b><i>(Marcos 16:15-16 - Hechos 2:38)</i></b>\r\n<ol>\r\n	<li>Aquellos que creen en Jesucristo habiéndose arrepentido de su antigua vida.</li>\r\n	<li>Aquellos que han nacido de nuevo en Cristo.</li>\r\n	<li>Aquellos que lo hacen sinceramente por amor a Dios y no por religiosidad.</li>\r\n</ol>\r\nEs un mandato dado por el Señor Jesucristo para todos aquellos que han creído en Él, a través del bautismo damos testimonio en la tierra y en el cielo de nuestra nueva vida. Mateo 28:19, el bautismo no es una opción sino un mandamiento, si realmente hemos creído en Jesucristo obedeceremos este precioso mandamiento.\r\n\r\n<b>¿QUÉ DEL BAUTISMO DE NIÑOS?</b>\r\n\r\nLa enseñanza de bautizar niños no tiene base bíblica y es a causa de tradiciones, aunque la edad no es determinante, obviamente se requiere que la persona tenga edad y madurez suficiente para reconocer el significado del bautismo y decidir por su propia voluntad el seguir a Cristo. De los niños Jesús dijo <b><i>que de ellos es el Reino de Dios</i></b>. <b><i>(Mateo 19:14 - Ezequiel 18:20) </i></b>afirma la justicia de Dios es que los niños no serán castigados por el pecado de sus padres.\r\n\r\nLa conciencia activa el pecado, por lo tanto un niño que muere sin bautizarse es un alma salva de conciencia limpia, es decir, no tenía discernimiento del bien o el mal y va directamente a la presencia de Dios, a diferencia de una persona con clara conciencia de lo bueno o lo malo.\r\n\r\nNo permita que ninguna tradición religiosa impida cumplir este mandamiento tan importante, el hacerlo no es faltar al respeto a sus padres que posiblemente lo bautizaron de bebé, ellos querían lo mejor para usted según su comprensión, pero ahora ha aprendido el verdadero significado del bautismo.\r\n\r\nCamine en obediencia y de seguro el Señor continuará bendiciendo tu vida.\r\n\r\nDescargue ésta clase en formato PDF para imprimir', 'Discipulado 1-4 - Un Paso de Obediencia', '¿Qué hacemos con una persona que ha muerto? ¡Lo enterramos! ¡Es la única manera de tratar con un muerto! La Biblia dice que hemos muerto al pecado cuando permitimos que Jesucristo entre a nuestro corazón', 'publish', 'closed', 'open', '', 'd104-un-paso-de-obediencia', '', '', '2014-11-11 07:50:40', '2014-11-11 10:50:40', '', 0, 'http://www.puertadevida.com/?p=33', 7, 'post', '', 0),
(42, 11, '2013-10-08 21:33:33', '2013-10-09 00:33:33', 'El <strong>Discipulado 2</strong> es un material de formación para aquellos que ya han pasado por el proceso del discipulado 1, el bautismo y desean participar del <strong>Encuentro Cara a Cara.</strong>\r\n\r\n<!--more-->\r\n\r\nPor éste motivo deberás descargar cada una de las unidades y rendir el progreso del mismo a tu líder de hogar o la persona que ha sido designada para ayudarte a crecer espiritualmente y afirmarte en el Señor.\r\n\r\n[callout font_size="13px" style="cherry"]Éste material no debe ser difundido por las redes sociales, o compartido en otros sitios, ya que está preparado para el trabajo en nuestro ministerio, y puede, que en lugar de ayudar a otros, generar un malentendido. ya que la visión o propósito de otros ministerio es diferente\r\nÉsto puede causar divisiones, y confusión en esos lugares, sin mencionar que en las manos de personas inmaduras puede frenar o apartar del camino ya que para entender todo éste material es necesario el proceso antes mencionado.[/callout]\r\n\r\n<hr />\r\n\r\n<h3>Descargar Unidades del Discipulado 2 en Formato PDF para Imprimir</h3>\r\n<ul>\r\n	<li><a title="Discipulado 2 Manual Completo" href="http://www.puertadevida.com/discip/D2_0.pdf">Manual Completo</a></li>\r\n</ul>\r\n<h3>Descargar unidades individuales</h3>\r\n<ul>\r\n	<li><a title="Discipulado 2 Unidad 1" href="http://www.puertadevida.com/discip/D2_1.pdf">Unidad 01</a></li>\r\n	<li><a title="Discipulado 2 Unidad 2" href="http://www.puertadevida.com/discip/D2_2.pdf">Unidad 02</a></li>\r\n	<li><a title="Discipulado 2 Unidad 3" href="http://www.puertadevida.com/discip/D2_3.pdf">Unidad 03</a></li>\r\n	<li><a title="Discipulado 2 Unidad 4" href="http://www.puertadevida.com/discip/D2_4.pdf">Unidad 04</a></li>\r\n	<li><a title="Discipulado 2 Unidad 5" href="http://www.puertadevida.com/discip/D2_5.pdf">Unidad 05</a></li>\r\n	<li><a title="Discipulado 2 Unidad 6" href="http://www.puertadevida.com/discip/D2_6