(214, 12, '2014-01-21 21:32:59', '2014-01-22 00:32:59', '<p align="center">Quién es Dios?  Quién soy con relación a Dios? Como Dios nos ve?</p>\r\n<b><span style="text-decoration: underline;"> </span></b>\r\n\r\n<b><span style="text-decoration: underline;">Texto bíblico</span></b><b> 1 Juan 3:1-2</b>  Mirad cuál <b><span style="text-decoration: underline;">amor</span></b> nos ha dado el Padre. . .  <b>(Leer todo el texto)</b>\r\n\r\n<b>Introducción; </b>El mayor problema de nuestra sociedad<b> </b>es la carencia de identidad, se vive de copias,\r\nSe copia la manera de hablar, la manera de vestir, la manera de peinarse, o sea, la originalidad pasó a un segundo plano, porque se piensa que más fácil es copiar que crear.\r\n\r\n&nbsp;\r\n\r\nLa copia tiene su fuente y esa fuente es la oscuridad, el diablo, ya que él no puede crear nada, solo puede copiar, y de eso ha hecho una industria tan grande que lo original se ve como inalcanzable porque la diferencia es el precio, lo que cuesta. Ej. CD, Videos, etc.\r\n\r\n&nbsp;\r\n\r\nDios no quiere que nos hagamos parecer hijos de Dios, una copia, él quiere que podamos asumir nuestra identidad la cual es, hijos de Dios.\r\n\r\n<b> </b>\r\n\r\n<b>Desarrollo.\r\n<span style="text-decoration: underline;">1- Somos concebidos por Dios – Juan 1:13\r\n</span></b>Cuando alguien ora por tu vida, actúa el Espíritu Santo y hace que te acerques a Jesús para conocerle y recibirlo.\r\n\r\n&nbsp;\r\n\r\n<b><span style="text-decoration: underline;">2- Somos nacidos de Dios – Juan 1:11-12\r\n</span></b>Cuando confesamos a Jesús como  nuestro Señor y Salvador, ese día es el día de nuestro nacimiento en Dios, es allí donde recibimos el Espíritu Santo que va ayudar a ese BB espiritual a crecer y desarrollarse.\r\n\r\n&nbsp;\r\n\r\n<b><span style="text-decoration: underline;">3- Somos hijos de Dios – Juan 1; 12\r\n</span></b>Has nacido de Dios por el Espíritu Santo y eso te da el derecho de hijo y si eres hijo también eres heredero y si eres heredero tienes derecho a la herencia de tu Padre Dios.\r\nPero mientras maduras para recibir tu herencia, Dios te da promesas de vida para que las puedas tomar y disfrutar.\r\n\r\n&nbsp;\r\n\r\n<b><span style="text-decoration: underline;">Algunas promesas divinas\r\n</span></b><b>Yo estaré contigo Mateo 28; 20\r\nNada te falta y nada te faltara. Salmo 23</b><b></b>\r\n\r\n<b>Clama a mi yo te responderé. Jeremías 33; 3</b><b></b>\r\n\r\n<b><span style="text-decoration: underline;"> </span></b>\r\n\r\n<b><span style="text-decoration: underline;">Conclusión:\r\n</span></b>Identidad significa quién soy en Él, en primer lugar antes de conocerle, somos creación de Dios, al conocerle pasamos a ser hijos de Dios<b></b>\r\n\r\nDios te llamo para que hacerte su hijo, el diablo no respeta a los extraños, pero debe respetar y tener cuidado de aquellos que han asumido su verdadera identidad. <b>Hijos de Dios!!!.</b>\r\n\r\n<b>\r\n</b>\r\n\r\n<b> </b>\r\n\r\n<b><span style="text-decoration: underline;">Preguntas de repaso:</span></b>\r\n\r\n<b>Quién es Dios?  </b><b>Nuestro Padre</b><b></b>\r\n\r\n<b>Quién soy con relación a Dios, sobrino, primo o hijo? </b><b>Hijo</b>\r\n\r\n<b>Como Dios nos ve? </b><b>Como hijo</b><b></b>', 'Clase 1 - Identidad', '', 'publish', 'open', 'open', '', 'clase-1-identidad', '', '', '2014-01-22 10:34:29', '2014-01-22 13:34:29', '', 0, 'http://www.puertadevida.com/?p=214', 0, 'post', '', 0),
