(337, 11, '2014-01-27 11:23:44', '2014-01-27 14:23:44', 'El conflicto te puede llevar a consumir (desaparecer) a otra persona. Es lo peor que puede pasar a un líder, ya que la persona es una herramienta que Dios usa para formarnos en una situación.\r\n\r\nDebo saber manejar los conflictos y los tiempos. Intervenir cuando un problema estalla no sirve, debemos actuar con coherencia y no con nuestro temperamento.\r\n\r\n<!--more-->\r\n\r\nCuando existe una lucha de poderes es una oportunidad para que aparezca un conflicto. Mi tarea, función y servicio están dedicados al señor.\r\n\r\nLos conflictos que no se saben manejar terminan consumiéndote. El conflicto puede ser el origen de una ruptura entre amistades, ministerios o pares de hogar\r\n\r\nAl trabajar en parejas o equipo ministerial habrá roces, malos entendidos, diferencias. Es un riesgo pero es la única manera de avanzar y lograr más\r\n\r\nEl diccionario define al conflicto como una oposición franca y hostil que da como resultado de dos puntos de vista opuestos.\r\n\r\nEl problema no es el desarrollar ministerios en parejas ministeriales, más bien cuando se trabaja desarrollando parejas ministeriales se pisa el terreno de la oposición cuando ambos tienen puntos de vista diferentes o puntos de vista que no coincidan.\r\n\r\nSi fuera imposible realizar el trabajo de la obra en equipos, Jesús jamás habría armado un equipo con sus discípulos y tampoco los hubiera enviado a predicar de dos en dos.\r\n\r\nMuchas empresas instituciones e iglesias se han dividido, perdiendo su potencial, porque no fueron capaces de solucionar sus conflictos.\r\n\r\nEn lugar de tener grandes iglesias poderosas y llenas de autoridad tenemos congregaciones pequeñas débiles que son el producto de la inconformidad y del no haber resuelto las situaciones de conflicto\r\n\r\nEs cierto que trabajar en equipo y en parejas ministeriales es más complicado y muchas veces queremos tirar la toalla por no confrontar con madurez dichas complicaciones.\r\n\r\nUna opinión puede ser contraria pero no necesariamente debe desembocar en un conflicto ni aun si existiera malestar. No sería motivo para generar hostilidades.\r\n\r\nSantiago 4:1 enmarca el origen de todo conflicto\r\n\r\nUn conflicto es un problema carnal, la raíz de todo problema está en la carne. la carne no puede discernir las cosas que son del espíritu. Cuando existen evidencias de la carne es difícil permitir que el espíritu interceda.\r\n\r\nEn todo conflicto la carne es el actor principal. Para resolver un conflicto se necesita ser revestido de humildad. La humildad es lo contrario del orgullo y la altivez. El orgullo es el padre de toda división.\r\n\r\nLa altivez es con lo que más se suele identificar al diablo.\r\n\r\nSatanas mata, destruye y derriba grandes ministerios con una\r\n\r\nPara resolver el conflicto no puedes poner tu <span style="text-decoration: underline;">propia</span> medida Sino la del señor a través de su palabra\r\n\r\nLa manera de alinear tu carne con el espíritu es matar tu carne y someterla al consejo de la palabra\r\n\r\nNo debes hacer caso de los rumores. Debes ser diligente e investigar las causas y procura no inclinarte hacia alguna de las partes involucradas. Dt 19:15 Mt 18:5-7\r\n\r\nProcura ser una persona de honra. Que no seas etiquetado por pleitos. Di no a la contienda y cuida tu reputación.\r\nProv. 20:3 / 19:11', 'Resolviendo Conflictos - 1ra Parte', 'El conflicto te puede llevar a consumir (desaparecer) a otra persona. Es lo peor que puede pasar a un líder, ya que la persona es una herramienta que Dios usa para formarnos en una situación.', 'publish', 'open', 'open', '', 'resolver-conflictos', '', '', '2015-01-23 08:24:57', '2015-01-23 11:24:57', '', 0, 'http://www.puertadevida.com/?p=337', 0, 'post', '', 0),
