(330, 11, '2014-01-27 11:14:51', '2014-01-27 14:14:51', 'Todo líder es rodeado de tentaciones que buscaran deteriorar su imagen como tal. Un líder que teme a dios tendrá el valor para no caer en las garras de la tentación.\r\n\r\n[callout1]El poder seduce… Si se quiere conocer el corazón de una persona, dale poder.[/callout1]\r\n\r\nQué te parece más fácil de manejar el éxito o el fracaso?\r\nLa mayoría de la gente no sabe hacer frente al hecho de ocupar un alto puesto, de hecho los destruye\r\n\r\n<!--more-->\r\n\r\nEl liderazgo viene acompañado de tres ventajas primordiales\r\n<ol>\r\n	<li><strong>Posición</strong>: podes llegar a estar más alto. La medida de tu efectividad, es la importancia de tu posición. La posición viene por el Hacer no por Parecer.</li>\r\n	<li><strong>Poder</strong>: podes llegar a hacer más. No funciona lo que no es de Dios.</li>\r\n	<li><strong>Privilegios</strong>: podes llegar a tener más.</li>\r\n</ol>\r\nCada una de las cosas mencionadas, son un privilegio legítimo de un liderazgo.\r\n\r\nEl esfuerzo y la labor extraordinarios que has aportado te ofrecen una posición mejor, con más poder y mejores privilegios\r\n\r\nSin embargo debemos considerar estos privilegios como una <strong>MANO DE HIERRO EN GUANTE DE TERCIOPELO.</strong>\r\n\r\nTodos y cada uno de ellos traen tentaciones lo suficientemente grande como para causar tu caída como líder si hacen mal uso de ellos. (1 Cor 10:12)\r\n\r\n[callout1]Un pensador dijo: el poder corrompe, el poder absoluto corrompe de manera absoluta.[/callout1]\r\n\r\nLo bueno de todo esto es que Dios nos proporciona un antídoto. El líder sabio estudia las situaciones, las reconoce las tentaciones y aplica el antídoto.\r\n\r\nCuando llegamos al versículo 14 del capítulo 5 de Nehemías, el lleva 12 años en el puesto de gobernador de Judá. Los que estuvieron antes que el hicieron mal uso de su poder, privilegios y posición para favorecer sus ganancias egoístas\r\n\r\nSi bien es cierto que al colocarte como líder obtienes una posición diferente a la de tus seguidores debes desarrollar tu liderazgo de manera sabia para poder ejercer tu autoridad sin que esta se convierta en autoritarismo\r\n\r\nLa posición es única y debe ser respetada no por el titulo sino por el ejemplo que mostramos a la hora de servir a los demás\r\n\r\nLa tentación de usar tu autoridad para mandar estará latente para un protagonismo popular. Como líder busca ser protagónico por tu forma en que enseñas a tus discípulos a presidir y a servir.\r\n\r\nEl corazón de un líder está guardado en Dios a través de su palabra.', 'Las Tentaciones del Liderazgo', '', 'publish', 'open', 'open', '', 'las-tentaciones-del-liderazgo', '', '', '2014-01-27 11:18:58', '2014-01-27 14:18:58', '', 0, 'http://www.puertadevida.com/?p=330', 0, 'post', '', 0),
(340, 11, '2014-01-27 11:26:47', '2014-01-27 14:26:47', 'El carácter es el fundamento esencial del crecimiento y estabilidad de todo liderazgo\r\n\r\nUn liderazgo se mantiene por el carácter. Un líder esta para resolver situaciones de vida en los que lo siguen. El carácter debe ser forjado (al fuego de las pruebas) y luego formado.\r\n\r\n<!--more-->\r\n\r\nUna cosa es lo que se VE, pero otra cosa es lo que ES. Las pruebas son las que revelan la verdadera esencia del carácter y personalidad de una persona.\r\n\r\nTodos los personajes de la biblia eran hombres de carácter, aunque muchas veces fallaron, el carácter que Dios puso en ellos, la formación de ese carácter hizo que superaran las situaciones. Ej: Jonás.\r\n\r\nDios está tratando todos los días con el carácter de las personas. Es necesario que aprendamos lo que es el carácter y que conozcamos la condición del mismo (Heb 13:5)\r\n\r\nSon aquellas cualidades morales que cada individuo posee. En griego una definición es confiabilidad\r\n\r\nNuestro carácter determina si el valor de las cosas que hacemos es excelente o pobre. El valor de lo que hacemos refleja el valor de nuestro carácter\r\n\r\nEl carácter se puede definir como señal o marca que distingue algo. Una vez que está marcado, no hay forma de cambiar esa impresión.\r\n\r\nComo discípulos del Señor debemos trabajar para que el carácter de Jesucristo sea formado en nosotros (Gal 5:16)\r\n\r\nHoy nos representan los títulos y pretendemos que hablen por nosotros. Pero es el carácter el que habla por nosotros\r\n\r\nLa forma en que un líder trata con las circunstancias de la vida habla mucho de su carácter, pues las crisis no necesariamente forman un carácter, pero si lo revelan', 'El Caracter de un Lider', '', 'publish', 'open', 'open', '', 'el-caracter-de-un-lider', '', '', '2015-01-23 08:25:23', '2015-01-23 11:25:23', '', 0, 'http://www.puertadevida.com/?p=340', 0, 'post', '', 0),
(342, 11, '2014-01-27 11:28:59', '2014-01-27 14:28:59', 'Los ministerios de nuestros líderes deben estar enfocados en el logro de la visión y no esclavizados en las prisiones de la amargura\r\n\r\nHemos observado que el conflicto destruye más rápido las relaciones de amistad, trabajo o ministeriales\r\n\r\n<!--more-->\r\n\r\nSi yo se que el propósito del hogar es ganar almas, debemos coronar el año, no matarlo, celebrando el trabajo realizado, esto sucede si tenemos expectativa del trabajo por venir y su recompensa\r\n\r\nAdemás lidiar con conflictos cotidianamente es engorroso y seguramente terminara enfermándote (mente primero, luego el corazón)\r\n\r\nComo lideres tenemos la responsabilidad de ser sabios para poder resolver los conflictos en medio de la gente que presidimos, un líder debe ser una persona sabia. Es obvio que siempre habrá contiendas, pero el darles la solución siempre hablara de tu audacia y sabiduría para que no permitir que te destruyan\r\n\r\nAlgunos pensamientos\r\n<ol>\r\n	<li>Vivir por vivir o vivir en paz, (la primera es sobrevivir, la segunda es disfrutar la vida)</li>\r\n	<li>Es más fácil destruir que construir</li>\r\n	<li>Cuando piensas en grande piensas en Dios</li>\r\n	<li>Mejoran nuestras relaciones cuando mejoramos la calidad</li>\r\n</ol>\r\nResponsabilidades del liderazgo\r\n<ol>\r\n	<li><b>Mantente</b> <b>fresco</b> cuando otros estén furiosos ¿Cómo funcionaste hasta hoy?</li>\r\n	<li>Tú debes tener el <b>control</b> <b>de</b> <b>tus emociones</b>, no lo pierdas</li>\r\n	<li>Espera <b>calmarte</b> <b>antes</b> de hablar</li>\r\n	<li>La <b>relación</b> es más <b>importante</b> que la discusión</li>\r\n	<li>Trata a la gente como si fuera un pariente rico del que eres parte de su herencia</li>\r\n	<li>Nunca te arrepientas de tratar muy bien a la gente, pues el mejor negocio en todos los sentidos</li>\r\n	<li>Busca el lado positivo y agradable aún de las situaciones más complicadas y dolorosas</li>\r\n	<li>Trata de convertir los problemas en <b>oportunidades para resplandecer</b></li>\r\n	<li><b>Pregunta antes de reaccionar</b></li>\r\n	<li>Aprende a <b>escuchar a los demás</b> sin irritarte</li>\r\n	<li><strong>Escucha</strong> para contestar y no para contender</li>\r\n	<li>No digas o hagas algo que pueda herir a otra persona sea quien sea</li>\r\n	<li>Aprende a <b>separar</b> el <b>problema</b> de las <b>Personas</b></li>\r\n	<li>Tu conyugue, tu padre, tu pareja ministerial, pastores, amistades, etc. <b>no son tus enemigos ni tú de ellos</b></li>\r\n	<li>Procura <b>decir palabras edificantes</b> y constructivas</li>\r\n	<li><b>Nunca hables</b> para manifestar <b>palabras venenosas</b> que hagan sentir mal a alguien</li>\r\n	<li><strong>Si tus palabras no mejoran al silencio, es mejor que permanezcas callado</strong></li>\r\n</ol>\r\nPueden generarse conflictos en tu equipo por cualquier causa, pero tu nunca debes ser el protagonista de ninguno de ellos. Recuerda que estas puesto para guiar, no para ser tropiezo\r\n\r\nIntercesion (sal 92:12-14) interceder para que las palmeras plantadas en la casa del señor sean bendición y no obstáculos que entorpezcan el crecimiento', 'Resolviendo Conflictos - 2da Parte', 'Los ministerios de nuestros líderes deben estar enfocados en el logro de la visión y no esclavizados en las prisiones de la amargura. \r\nHemos observado que el conflicto destruye más rápido las relaciones de amistad, trabajo o ministeriales', 'publish', 'open', 'open', '', 'resolviendo-conflictos-2da-parte', '', '', '2015-01-23 08:25:47', '2015-01-23 11:25:47', '', 0, 'http://www.puertadevida.com/?p=342', 0, 'post', '', 0),
