(520, 11, '2014-04-03 12:57:45', '2014-04-03 15:57:45', 'No hay nada más frustrante que no saber quienes somos o por que nos encontramos en éste lugar. La desorientación creada por ésta incógnita es abrumadora. La falta de identidad es la principal razón por la cual los planes y propósitos de Dios no se cumplen en nuestra vida. Es el motivo por el cual muchas personas se encuentran estancadas en una posición espiritual, incluso material, emocional, profesional y relacional inconstante y dudosa.\r\n\r\n<!--more-->\r\n\r\nQuien soy?\r\n\r\nLa gran mayoría de las personas no saben quienes son realmente. Muchos piensan que lo saben solo por que conocen quienes son sus padres o de que familia o sitio geográfico provienen, pero el conocer quienes somos en realidad no se descubre por esas vías, sino que viene por conocer "de donde" venimos (1 Pedro 2:9).\r\n\r\nNuestro verdadero origen no se encuentra en la evolución, tampoco somos fruto de la casualidad. Somos la creación más importante y preciosa que nuestro Padre Celestial haya puesto sobre la tierra. Somos la corona de la creación y estamos hechos a Su imágen <span style="line-height: 1.6em;">.</span>\r\n\r\nQuienes Somos? Somos sus Hijos por medio del sacrificio de Cristo en la cruz y la gracia que nos cubre. Hemos sido hechos Hijos gracias a la sangre derramada por nosotros en pago por la redención de nuestros pecados <span style="line-height: 1.6em;">(</span><span style="line-height: 1.6em;">1 Juan 3:1-3</span><span style="line-height: 1.6em;">)</span><span style="line-height: 1.6em;">.</span>\r\n\r\nUn hijo tiene derecho a todo lo que posee su padre. de la misma forma nosotros, por medio de Cristo, tenemos derecho a todo lo que el Padre <strong>ES</strong>. Nótese que no digo tiene, sino ES, por que de Dios proviene todo, lo que se ve y lo que no.\r\n\r\nDonde estoy?\r\n\r\nMe encuentro en éste planeta, una minuscula parte de materia en el universo, insignificante en comparación con toda la vastedad del cosmos, pero que hay de especial aquí? Nosotros (Efesios 2:10). Dios se ha placido en su creación por lo que está esperando que sus hijos hereden todo lo que Él creó para nosotros, y comiencen a ejercer Su autoridad y gobierno sobre ésta creación.\r\n\r\nCuando sabemos éstos principios, podemos levantar nuestra cabeza y mirar hacia donde vamos. No podemos encontrar nuestro propósito y destino si no conocemos nuestro origen y nuestra identidad. El saber quienes somos nos da acceso automático a toda la posibilidad que nuestra identidad nos otorga.\r\n\r\nNo hay nada superior a ser HIJO. Uno sabe que es criatura de Dios, todos lo somos, pero no todos llegan a ser hijos. El ser Hijo es como un titulo de la nobleza, no se le otorga a todos ni se regala, hay que ganárselo (Gálatas 3:27-29). El precio de éste reconocimiento es nuestra vida, por que fue una vida, la más preciosa que existe, la que fue entregada a fin de que podamos ser elegibles para esa distinción (Gálatas 2:20).\r\n\r\nNo hay nada que podamos decir, pensar o hacer que pueda asegurarnos que recibiremos ésta distinción, solo el entregar nuestra vida por completo, sin pretenciones, dejando a un lado todo egoísmo, para así dar lugar al espíritu Santo que comience a formar en nosotros, de acuerdo al plan original, la persona de Cristo dentro de nuestra Vida.(Lucas 9:23-27)\r\n\r\nAHora... estas recordando quien sos? puedes hacer memoria de cual es tu verdadera identidad?', 'Quien soy..? Donde estoy..?', '', 'publish', 'open', 'open', '', 'quien-soy', '', '', '2015-01-23 08:23:42', '2015-01-23 11:23:42', '', 0, 'http://www.puertadevida.com/?p=520', 0, 'post', '', 0),
