(527, 11, '2014-04-04 10:31:16', '2014-04-04 13:31:16', 'El apego de los niños con los juguetes a veces es muy superficial, pero algunas veces el lazo entre éstos va más allá y los que les voy a compartir nos da un pequeño ejemplo de cuanto le importamos y cuanto Cristo nos ama.\r\n\r\n<!--more-->\r\n\r\nCuando mi hija mayor era más pequeña, le regalaron un pequeño tigre de peluche. Su nombre fue, obviamente, <strong>tiger... </strong>asi es, como el de disney. Al principio no parecía haber una diferencia entre éste y los demás juguetes que tenia. Mientras el tiempo pasaba, ella comenzó a desarrollar un vínculo especial por su tigre. Él permanecía a su lado en las noches, la acompañaba en sus juegos, incluso asistían juntos a las celebraciones de la iglesia. La forma en que ella amaba éste peluche era a la vez tierna y sorprendente.\r\n\r\nPasaron los años y un día el tiger se perdió. No sabíamos donde buscar y el desconsuelo en los ojos de mi hija era desgarrador, y lo fue por un tiempo, hasta que alguien pensó que tal vez otro peluche podría cubrir el hueco que el tigre había dejado. Asi llego una perrita blanca de peluche con un gran corazón que decía <em>TE AMO</em>, Ella la llamó <strong>flopy</strong> y al parecer la estrategia funcionó.\r\n\r\nLa tristeza en los ojos de mi hija se había ido y así fue hasta hace unos días, cuando de la nada el tigre apareció, no llego caminando ni por obra de magia, simplemente allí estaba. La emoción de mi hija por haberse reencontrado con su viejo amigo era insuperable. Después de tanto tiempo allí estaba... no importó que estuviera sucio, tampoco importó que estuviera roto... lo único que importaba era que allí estaba... después habría tiempo de lavarlo y arreglarlo, tenían mucho tiempo por recuperar.\r\n\r\nEstando en casa y aún desbordando de alegría por su reencuentro, en un momento ella fue a su cama y tomo a flopy mientras sostenía a su viejo amigo en sus brazos y los presentó. ahora ya no tenía un compañero de juegos, sino dos.\r\n\r\nDe la misma forma, el señor nos demuestra ésta clase de amor, Su inmenso y eterno amor, a través de la historia del hijo prodigo, dándonos la magnitud del amor que siente por nosotros (Lucas 15:11-32).\r\n\r\nAlgo para destacar de todo ésto es que Él no solo nos creó, sino que nos dio un nombre (Gen. 35:10), no el nombre que nos dieron nuestros padres, sino uno que Él mismo nos dio antes de la fundación del mundo el cual refleja nuestro propósito. Ésto implica que él conoce nuestra verdadera identidad delante de sus ojos. El conocer la identidad te permite abrir la puerta de las cosas que te pertenecen.\r\n\r\nEl amor de Dios por la humanidad es tan grande que al enviar a Cristo a morir para creó la vía de reconciliación de la humanidad con Él mismo (2 Cor 5:18). Al abrir ésta puerta, Él corrió hacia nosotros y lo le importó lo sucio o rotos que estábamos, nos abrazó, nos besó y lo mejor de todo es que está tan feliz de volver a encontrarnos que nos presenta a todos sus otros hijos con orgullo, rebosante de alegría por que uno más de sus hijos se encuentra con Él.', 'Éstos son Míos!', '', 'publish', 'open', 'open', '', 'estos-son-mios', '', '', '2015-01-23 08:23:16', '2015-01-23 11:23:16', '', 0, 'http://www.puertadevida.com/?p=527', 0, 'post', '', 0),
