(533, 11, '2014-04-05 12:08:59', '2014-04-05 15:08:59', 'Muchas veces al enfrentar las dificultades nuestra primera reacción es decir "No Puedo", otras sin embargo sacamos del bolsillo nuestro versículo favorito del apóstol Pablo: "Todo lo puedo en cristo que me fortalece" (Fil. 4:13).\r\n\r\n<!--more-->\r\n\r\nHay algo en particular de éste pasaje que normalmente pasa desapercibido por aquellos que tienen la biblia como escape fácil o excusa a las situaciones de vida. Casualmente la razón por la que Pablo menciona éstas palabras se basa en su experiencia frente a las dificultades y bonanzas de la vida.\r\n\r\nDurante su ministerio, especialmente desde el principio, Pablo fue entrenado por la misma presencia de Dios. Al ser llamado, Dios le indico a Ananías "le voy a mostrar cuánto debe sufrir por mi nombre" (Hec 9:16). Hoy en día diríamos que a Dios se le fue la mano al decir ésto. pero recordemos que las formas y los pensamientos de Dios son mucho mayores y más profundos que los nuestros (Isaias 55:9). Nada de lo que Dios hace es por casualidad o fruto del azar. Dios no habla si no tiene un propósito para soltar su palabra, y la forma y las palabras que utiliza al pronunciarlo tienen un propósito y lo mejor de todo es que Él mismo afirma "mis palabras no volverán a mi sin cumplirlo" (Isaias 55:11)\r\n\r\nVolviendo a Pablo, el contexto de el pasaje de Filipenses, El contexto de ésa declaración es la preparación que Dios le dio a Pablo a medida que iba transcurriendo su ministerio. Él dice en el versículo 11: "he aprendido a estar contento con todo..." y en el versículo 12 nos da la clave de ésto: "He aprendido el secreto de vivir en cualquier situación."\r\n\r\nCualquier situación es CUALQUIER SITUACIÓN. Los problemas son una situación. El no saber como afrontarlos es el medio pro el cual Dios nos revelará Su Nombre a través de mostrarse a si mismo en nuestras vidas. Cuando Dios nos revela Su Nombre, lo que esta haciendo es mostrarnos su capacidad de hacer las cosas. Dios se muestra a nosotros en diferentes situaciones para mostrarnos una faceta de su esencia. es nuestro trabajo reconocer y tomar esa revelación de Dios y aplicarla en nuestro Diario Vivir.\r\n\r\nEl Nombre de Dios revela quien es Él. Cuando decimos Jehová (una traducción del original hebreo YHVH que significa YO SOY) estamos afirmando en primer lugar que el es ahora, no que fue ni que será, es ahora. Para Dios el tiempo que vivimos no existe, para el es siempre presente. cuando agregamos otras cualidades a Dios nos damos cuenta que, por ejemplo, Él es Ahora mi Salvador, Él es Ahora mi libertador, Él es Ahora mi proveedor... lo mejor de todo es que Él es Ahora mi padre.\r\n\r\nCuando enfrentamos los problemas debemos tener presente, al igual que Pablo, que Dios es Ahora, de ésta forma podremos avanzar más allá de nuestras posibilidades y llegar al conocimiento del secreto de vivir conformes en toda situación sabiendo que no es por nosotros, sino por la revelación de la persona de Cristo y el poder de Dios actuando en nuestra vida sin importar el tamaño que nuestras dificultades puedan aparentar, Dios es mucho más grande Ahora y Siempre!!!', 'Yo Puedo', '', 'publish', 'open', 'open', '', 'yo-puedo', '', '', '2015-01-23 08:22:49', '2015-01-23 11:22:49', '', 0, 'http://www.puertadevida.com/?p=533', 0, 'post', '', 0),
