(547, 11, '2014-04-06 13:09:24', '2014-04-06 16:09:24', '<span style="font-family: ''Droid Sans'', serif;">Salmo 27:8</span>\r\n\r\n<span style="font-family: ''Droid Sans'', serif;">La presencia de Dios es como un pez que está esperando ser capturado por nosotros. Al igual que la pesca, podemos encontrar varios escenarios donde la podemos hallar y en cada uno de ellos la forma de alcanzarla es diferente. De la misma forma, mientras nos internamos a más profundidad, mayor ser el tamaño y fuerza de la presencia. Ésta puede presentarse como una bendición, sanidad, liberación, revelación, y un incontable abanico de manifestaciones en las que el Dios Soberano del universo decida y quiera hacerlo.</span>\r\n\r\n<!--more-->\r\n\r\n<span style="font-family: ''Droid Sans'', serif;">Volviendo a nuestro ejemplo, para la pesca necesitamos unos pocos elementos que son indispensables: </span>\r\n<ul>\r\n	<li><span style="font-family: ''Droid Sans'', serif;">Una Caña (o Red)</span></li>\r\n	<li><span style="font-family: ''Droid Sans'', serif;">Una línea, cuerda o tanza</span></li>\r\n	<li><span style="font-family: ''Droid Sans'', serif;">Una Carnada</span></li>\r\n	<li><span style="font-family: ''Droid Sans'', serif;">Paciencia</span></li>\r\n	<li><span style="font-family: ''Droid Sans'', serif;">Perseverancia</span></li>\r\n</ul>\r\n&nbsp;\r\n<ol>\r\n	<li><span style="font-family: ''Droid Sans'', serif;">Nosotros somos </span><span style="font-family: ''Droid Sans'', serif;"><b>la caña</b></span><span style="font-family: ''Droid Sans'', serif;">. Debemos convertirnos en ese elemento que captura la presencia sobrenatural de Dios y la trae al ámbito natural. (Hec 9:15 - historia de pablo). Ser instrumento “de algo” o “para algo” implica que debemos ser consientes que no nos utilizarán para todo o todo el tiempo (2 Timoteo 2:19-21) hay una tarea especifica que el señor ha establecido en nuestro ser, primeramente en nuestro carácter (dones redentivos) Es necesario conocer “para que” fuimos llamados, ya que al conocer el “Para” comprenderemos mejor el “Como”.</span></li>\r\n</ol>\r\n<ol start="2">\r\n	<li><span style="font-family: ''Droid Sans'', serif;"><b>La Línea</b></span><span style="font-family: ''Droid Sans'', serif;"> es una vida de integridad. Fuere cual fuere el propósito por el cual Dios te ha llamado, obligadamente debes “Apartarte de la maldad” (2 Tim 2:19) solo así puedes acercarte a su presencia, o su presencia puede acercarse a ti. El es Santo y todo el que quiera acercarse a Dios debe apartarse de toda corrupción.\r\nUna de los requisitos que Dios estableció al pueblo de Israel a través del llamamiento de Abraham fue “Sal de tu tierra y de tu parentela” (Gn. 12:1-3). Éste requisito no fue un mero capricho de Dios. Esto era necesario porque el padre de Abraham y el lugar donde vivían era una sopa de ídolos. El Señor es el Gran YO SOY, el único y no va a permitir que Su gloria sea atribuía a nada fuera de Él mismo (Dt 5:6-10). El Celo del Señor no es el celo carnal y egoísta que expresamos en nuestra inmadurez, sino que se debe al gran amor que Él nos tiene. Él nos creo, y sacrifico lo más preciado que tenia para rescatarnos del pecado. Su amor inagotable desea ardientemente que nos volvamos a Él, Nuestro Padre, en amor y adoración reconociéndolo como el único Señor de nuestras vidas. Continuamente vemos en las escrituras que el Señor nos advierte a llevar una vida de santidad, apartarnos del pecado y de la maldad, a ser justos y ayudemos a los demás (Ex. 34 - Deut 7,28 – Lv. 26)</span></li>\r\n</ol>\r\n<ol start="3">\r\n	<li><span style="font-family: ''Droid Sans'', serif;"><b>La carnada </b></span><span style="font-family: ''Droid Sans'', serif;">es la forma en la que haremos que la presencia se acerque lo suficiente para poder alcanzarla. Si bien está esperándonos, debemos demostrar un interés genuino en recibirla. (2 Sam 24:24). “Dios no nos va a dar nada que no sepamos valorar, mucho menos Su Presencia”. Nuestro atrayente se revela a Dios a través de:</span></li>\r\n</ol>\r\n<ul>\r\n	<li><span style="font-family: ''Droid Sans'', serif;">la oración (Dn 9:3 – 1 Reyes 9:3)</span></li>\r\n	<li><span style="font-family: ''Droid Sans'', serif;">la adoración (2 Cron 5:12-14)</span></li>\r\n	<li><span style="font-family: ''Droid Sans'', serif;">el ayuno (Hec 10:30 – Esdras 8:21,23)</span></li>\r\n	<li><span style="font-family: ''Droid Sans'', serif;">el estudio de la palabra (Prov 2:1-5 – 2 Cro 34:3 – Hc 8:25-35)</span></li>\r\n</ul>\r\n<span style="font-family: ''Droid Sans'', serif;">Cada persona elige cuál de estas es la más indicada para su vida, su favorita, pero llega un punto en el que debe utilizar otro tipo de atrayente o utilizar varios al mismo tiempo a medida que busca una captura mayor. La forma en que podamos traer esa captura a nuestra vida también variará dependiendo que estamos buscando. Mientras mayor sea, mas pelea dará. (Gén 32:22-30 )</span>\r\n<ol start="4">\r\n	<li><span style="font-family: ''Droid Sans'', serif;"><b>La paciencia</b></span><span style="font-family: ''Droid Sans'', serif;"> es una habilidad que desarrollamos a medida que vamos aprendiendo. Es básicamente saber que algo va a suceder, confiar en que sucederá pese las dificultades (Heb 11:1). Esta es la fe que debe crecer en nuestro ser. Uno no puede pretender capturar algo inmediatamente luego que arrojamos nuestra línea. Si bien en la misericordia y gracia de Dios esto puede pasar alguna vez, es necesario entender que la mayoría de las veces Dios utilizara el proceso de la </span><span style="font-family: ''Droid Sans'', serif;"><b>Paciencia</b></span><span style="font-family: ''Droid Sans'', serif;"> para moldear nuestro carácter y volvernos sumisos a su voluntad y sus propósitos.</span></li>\r\n</ol>\r\n<ol start="5">\r\n	<li><span style="font-family: ''Droid Sans'', serif;"><b>La perseverancia</b></span><span style="font-family: ''Droid Sans'', serif;"> es necesaria para no perder el enfoque de lo que queremos lograr (Josué 1:6-7). Muchas veces llegaremos al punto donde nos parece que nada de lo que hacemos vale la pena, que simplemente estamos perdiendo el tiempo y que sería mejor buscar hacer otra cosa, pero en realidad es Dios mismo que esta "evitándonos" para revelar y desarrollar en nosotros esas ganas de tenerlo, de encontrarlo y de disfrutar de su compañía. (Mat 7:7-8)</span></li>\r\n</ol>\r\n<span style="font-family: ''Droid Sans'', serif;">Cuando el Señor le dijo a Pedro “Vé mar adentro” (Lucas 5:1-6), no solo se refería a ir físicamente a la parte más profunda de ese cuerpo de agua, sino que le indicaba: “busca más profundamente mi presencia, esfuérzate por llegar sumergirte mas donde tus fuerzas y capacidades ya no cuentan, sino que dependes solamente de mi”, En el libro de Ezequiel podemos encontrar una ilustración similar cuando el Ángel del Señor guía al profeta a internarse más en el rio.</span>\r\n\r\n<span style="font-family: ''Droid Sans'', serif;">A medida que te sumerjas en Dios tus capacidades e independencia irán quedando relegadas, ganando así lo mejor que Dios tiene para cada uno de nosotros... Él mismo</span>\r\n\r\n&nbsp;', 'Vamos de Pesca!', 'La presencia de Dios es como un pez que está esperando ser capturado por nosotros. Al igual que la pesca, podemos encontrar varios escenarios donde la podemos hallar y en cada uno de ellos la forma de alcanzarla es diferente.', 'publish', 'open', 'open', '', 'vamos-de-pesca', '', '', '2015-01-23 08:22:15', '2015-01-23 11:22:15', '', 0, 'http://www.puertadevida.com/?p=547', 0, 'post', '', 0),
