(551, 11, '2014-04-07 18:43:29', '2014-04-07 21:43:29', 'Lo mejor de salir a pescar es que la mayor parte del trabajo no depende de nosotros. Si tenemos un papel que cumplir y una tarea que realizar, pero una vez cumplida nuestra parte solo debemos esperar. Dios no quiere que hagamos su trabajo, el detesta que nos ensañemos en buscar la forma de hacer lo que El quiere hacer. Nuevamente en el libro de Génesis tenemos el ejemplo de Abraham.  Antes de recibir a Isaac, el intento con sus fuerzas cumplir la promesa de Dios. El resultado fue Ismael. La carne trata de agradar a Dios, pero no puede hacerlo debido al pecado. El <b>no poder</b> implica directamente <b>intentar hacerlo</b>. Solo lo que Dios hace puede agradar Su corazón.\r\n\r\n<!--more-->\r\n\r\nDebemos dejar que la voluntad de Dios actúe en nosotros y comprender que somos simples instrumentos en sus manos. Debemos permitir que <b>El actúe</b> en nosotros para realizar <b>Su obra</b> con <b>Sus recursos</b> y a <b>Su tiempo</b>. Nosotros solo debemos descansar y estar atentos mientras esperamos que cumpla lo que prometió. (Heb 4:10-11) Descansar no es tirarse a dormir y olvidarse de lo que te rodea, el significado de descansar en el Señor implica un cesar de nuestras intenciones para que Él pueda revelarse en la manera que desee hacerlo, manteniéndonos alertas a nuestro alrededor para poner por obra lo que Dios quiere que hagamos en el momento que Él decida hacerlo.\r\n\r\nCuando llega el momento que Dios decidió para que recibamos aquello que estamos esperando nos da un leve toque para hacernos notar de su proximidad y espera que respondamos. Muchas de las bendiciones que Dios envía a nuestra vida se pierden ya que no estamos atentos. Un simple tirón y perdemos de vista no solo la bendición sino que también podemos llegar a perder mucho más. Un tirón imprevisto de una línea en un momento de distracción puede hacerte perder todo el equipo y quedarte con las manos vacías. Por esta razón el Señor da varios ejemplos en el nuevo testamento. (Lucas 12:35-38) Estar atentos nos permitirá responder adecuadamente hacia lo que Dios quiere hacer en nosotros. La respuesta adecuada es fundamental ya que de ésta dependerá si podremos o no en el momento indicado asirnos a lo que Dios está enviando sobre nuestras vidas. Es imperativo ser sensibles al Espíritu Santo para reconocer el momento adecuado para movernos, para hablar, para escuchar, para sentir, para recibir, para dar. Un ejemplo muy claro de cómo responder a lo que el Espíritu Santo nos manda a hacer es el Rey David. Durante el tiempo en el que el Señor lo promovía para llegar a Rey de Israel, muchas veces fue al campo de batalla. La razón por la cual en ningún momento fue herido es que él podía, en medio del furor y el estruendo de la batalla, escuchar la voz del Espíritu Santo diciéndole: “gira, golpea, ataca, defiéndete, agáchate, salta…” esto se debe a que mucho antes que fuera llamado a su propósito el invirtió tiempo mientras realizaba sus deberes diarios en conocer la voz de Dios.\r\n\r\nEl solo hecho de responder indica que ocupamos un papel activo en la obra que Dios quiere hacer en medio nuestro. Es muy diferente el estado de <b>RECEPCIÓN</b> al estado de <b>EXPECTACIÓN</b>.\r\n<ul>\r\n	<li>En el primero nos limitamos a recibir, no hacemos nada, somos pasivos e inertes. De allí surgen los “PEDIGUEÑOS”: dame esto, quiero aquello, dame, dame, dame, yo, yo, yo... Éste estado le resta importancia a la obra de Dios y denigra al Creador de Los Cielos y la Tierra al rol de un mayordomo esclavo que debe satisfacer todos nuestros caprichos. Nada más lejos de la realidad. Las cosas nunca llegan, y como niños caprichosos e inmaduros nos enojamos, hacemos berrinches y nos ofendemos. En los primeros momentos de nuestra vida cristiana y el desconocimiento de la verdad espiritual todos hacemos estas cosas como lo explica Pablo en 1 Cor 13:11. Debemos esforzarnos en crecer, enfocarnos en lo que Él quiere que hagamos y no lo que a nosotros nos parece que Él debe hacer por nosotros. (1 Pedro 2:1-3)</li>\r\n	<li>El segundo estado es un estado de asecho, activamente buscamos eso en lo que estamos interesados. Sabemos que algo tiene que pasar, no sabemos el momento en el cual va a suceder, pero nuestro interés y determinación provoca que algo suceda (Lucas 18-1-8) La insistencia cobra nuevamente valor en éste punto. El esperar algo conlleva a buscar la forma de alcanzar aquello por lo que estamos interesados, pero hay que recordar que no debemos hacer el trabajo de Dios, es muy diferente “hacer lo que Dios quiere que hagamos” a “hacer por nuestros medios lo que Dios dijo que Él iba a hacer”. (Is 55-8-9)</li>\r\n</ul>\r\nDebemos permitirle a Dios Usarnos para que cumpla a través nuestro Sus Propósitos', 'Tienes Algo?', 'Lo mejor de salir a pescar es que la mayor parte del trabajo no depende de nosotros. Si tenemos un papel que cumplir y una tarea que realizar, pero una vez cumplida nuestra parte solo debemos esperar', 'publish', 'open', 'open', '', 'tienes-algo', '', '', '2015-01-23 08:21:50', '2015-01-23 11:21:50', '', 0, 'http://www.puertadevida.com/?p=551', 0, 'post', '', 0),
