(554, 11, '2014-04-08 18:46:56', '2014-04-08 21:46:56', 'El ámbito donde podemos buscar la presencia siempre es a nuestro alrededor (Ro 1:20) En la biblia el agua mayormente se utiliza para representar un aspecto de la obra del Espíritu Santo, pero también es símbolo de gente. Pueden ser muchas aguas como un mar o un simple arroyo, es decir, en medio de multitudes o en nuestra propia familia. Cada ámbito requiere una destreza y carnada diferentes, pero el resultado es básicamente el mismo. Una captura, un encuentro con su presencia.\r\n\r\n<!--more-->\r\n\r\nSiempre nuestro aprendizaje y experiencia se inicia en un lugar calmo, un pequeño arroyo, es decir, nuestra familia y círculo de amistades. Allí es donde comenzamos a probar nuestras destrezas y donde comenzamos a aprender cómo utilizar nuestras herramientas. Allí también salen a luz nuestras debilidades, nuestro verdadero carácter, y lo mejor de todo, es allí donde comenzamos a cambiar nuestro olor. (2 cor 2:15-16) Siempre que alguien sale de pesca generalmente vuelve a casa con olor a pescado, si sale de día puede también regresar bronceado por el Sol, si sale de noche probablemente vuelva algo mojado por el rocío nocturno. Eso es lo que delata que esa persona ha estado realizando una actividad al aire libre. Lo mismo sucede con las personas que se deciden a buscar a Dios y en desarrollar una vida de intimidad con Él. La presencia de Dios cambia todo lo que somos, deja en nosotros el aroma de su gloria (Cantares 5:5) y nuestra apariencia cambia debido al contacto con su poder sobrenatural (Exodo 34:29) El Experimentar la presencia de Dios, el vivir un verdadero encuentro con Dios es la evidencia que hace que otras personas se pregunten y quieran acercarse a nosotros. Al vivir la experiencia de la comunión con Dios nos convertimos en lámparas que atraen a las personas que desesperadamente buscan una salida a sus necesidades pero por la oscuridad del pecado no pueden encontrar respuesta. (Lucas 8:16-17)\r\n\r\nCada ámbito en el que nos encontremos traerá consigo grandes recompensas pero también dificultades. Mientras más grande sean las adversidades que podamos enfrentar, hay que tener por seguro que la recompensa también será mayor. Ninguna dificultad es más grande que el premio que Dios tiene preparado para aquellos que la soportan (1 Cor 10:13).\r\n\r\nEn Marcos 4:35 vemos que Jesús entro en una barca y cruzo un lago. No nos dice si era grande o pequeño, pero sí que en medio del mismo se desato una fuerte tempestad que amenazaba con hundir el bote. Aquí podemos ver algunas cosas,\r\n<ol>\r\n	<li>Jesús dijo “<b>Crucemos al otro lado”. </b>Esto nos muestra la determinación para hacer algo en un ambiente que no es el nuestro (Jn 17:14-16). Continuamente en nuestro vivir diario debemos enfrentarnos a una realidad que no es a la que pertenecemos: Problemas económicos, enfermedades, inseguridad, etc. Nuestra actitud frente a ésta situación debe ser <b>Crucemos. </b>El cruzar significa atravesar las dificultades con la seguridad que llegaremos al otro extremo a salvo, confiando en que vamos a atravesar la prueba y que ésta quitara de nosotros algo en particular que no es útil para nuestra vida en el cumplimiento del propósito de Dios. En el pasaje nos muestra que Jesús iba con ellos. De la misma forma, debemos confiar en que nuestro Él estará con nosotros en todo momento. Ésa promesa la encontramos en el Isaías 43:1-3a</li>\r\n	<li><b>Se desató una Gran Tormenta</b>. Cuando uno se encuentra en un bote, barco o elemento de flotación en el medio de un cuerpo de agua extenso, no es lo mismo decir una tormenta a una Gran tormenta. Claro está que a mayor tamaño de la embarcación, mejor tolerará los embates del tiempo. Las aflicciones diarias a las que nos enfrentamos golpean sin piedad nuestra vida haciéndonos dudar si llegaremos a destino. Contantemente nos enfrentamos a dificultades que hacen tambalear nuestra determinación a seguir adelante. Nuestras fuerzas se agotan a medida que nos esforzamos en mantener todo dentro de nuestros límites seguros sin darnos cuenta que mucho del trabajo que estamos haciendo no sirve para nada. En medio de todo este trajín, Jesús había encontrado un buen lugar para descansar en el bote. En el momento que las dificultades se desatan a nuestro alrededor, pensamos que Dios ha abandonado el bote. No es así. El Salmos 121 nos lo afirma de una manera muy clara y también lo confirma el Señor mismo en Josué 1:5. Él estaba allí, siempre estuvo y siempre estará</li>\r\n	<li><b>Despiertan a Jesús</b>. El pasaje nos demuestra que los discípulos se afanaban en mantener la embarcación a flote, pese a que algunos de ellos eran experimentados navegantes gracias a los años que habían pasado trabajando como pescadores, pero que ni aún eso daba mucho resultado. La experiencia que podamos tener en las actividades diarias y la interacción con la gente muchas veces nos entorpece la vista y el juicio. Tratamos de hacer las cosas por nuestra cuenta sin percatarnos que aquél que realmente puede ayudarnos se encuentra a nuestro lado. Cuando los discípulos notaron que ninguno de sus esfuerzos rendía fruto, decidieron despertar al maestro. Al instante que el reprende al viento y todo queda en calma. La pregunta del señor para sus discípulos era, más allá de la dificultad que atravesaron, porque, a pesar de todo lo que venían viviendo con Jesús, ¿por que tuvieron miedo si sabían que el salvador del mundo venia con ellos? ¿Acaso no recordaban que anteriormente les había explicado que si no dudaban en la palabra podrían haber hecho ellos mismos que la tormenta se aplacara? No debemos olvidar el poder que hemos recibido de parte de Cristo a través de su sacrificio el mismo poder y autoridad que Él tiene, ya que hemos sido comprados por su sangre y hechos hijos de Dios. (Rom 8:15-17)</li>\r\n</ol>\r\nEn Marcos 5, justo después de éste incidente en medio del lago, vemos nuevamente que Jesús y sus discípulos enfrentan una dificultad de otra clase, esta vez espiritual. Muchas veces confiamos en Dios para los problemas cotidianos que, aunque pueden venir en cualquier tamaño y forma, los podemos ver claramente. Una historia muy distinta es el enfrentar dificultades de índole espiritual, como lo es una atadura, una maldición o incluso el ser objeto de un ataque de brujería, pactos o juegos aparentemente inofensivos pero con un trasfondo espiritual complejo y macabro. Como no conocemos el mundo espiritual, muchas veces no nos damos cuenta que éste tipo de problemas pueden causar daño más allá de nuestra vida, alcanzando a nuestros hijos e incluso varias generaciones de nuestra familia. Muchas veces estos problemas comienzan en generaciones anteriores y nosotros solo somos un nivel más que ha alcanzado en su ola de destrucción. Generalmente tememos siquiera pensar en las consecuencias de las cosas que afectan lo espiritual, ya que en realidad tememos admitir que no contamos con los recursos para poder hacer frente a éstas situaciones. Nos sentimos completamente vulnerables e inconscientemente omitimos dar crédito de conocimiento a esta realidad.\r\n\r\nEl texto de la escritura nos muestra que Jesús bajo de la barca y que a los pocos minutos una persona Muy endemoniada salió corriendo y se postró ante Jesús. Esto nos muestra que Cristo tiene <b>Todo el poder y la autoridad</b> frente al mundo espiritual de maldad. Todo espíritu inmundo conoce y reconoce a Jesús como el Hijo de Dios, por lo que no tienen más opción que rendirse ante su presencia (Hechos 19:13-16). Esto también nos muestra que solo a través de Cristo nosotros podemos llegar a tener la suficiente autoridad como para hacer frente al mundo espiritual de maldad. Solo Cristo tiene el poder para poder quitar todo yugo de opresión que haya sido puesto sobre nosotros, no importa la complejidad o el poder que ostente tener aquello que nos está atacando. (Fil 2:6-11) Cristo, a través de su sacrificio en la cruz, recibió todo el poder y la autoridad para vencer de una vez y para siempre.\r\n\r\nEl resultado de ese encuentro fue la liberación de una persona que había estado atormentada por mucho tiempo por muchos demonios, lo cual dio como fruto la predicación del evangelio en esa región a través del testimonio de ésa persona.', 'Buscando en todos lados', 'El ámbito donde podemos buscar la presencia siempre es a nuestro alrededor (Ro 1:20) En la biblia el agua mayormente se utiliza para representar un aspecto de la obra del Espíritu Santo, pero también es símbolo de gente. Pueden ser muchas aguas como un mar o un simple arroyo, es decir, en medio de multitudes o en nuestra propia familia.', 'publish', 'open', 'open', '', 'buscando-en-todos-lados', '', '', '2015-01-23 08:20:18', '2015-01-23 11:20:18', '', 0, 'http://www.puertadevida.com/?p=554', 0, 'post', '', 0),
