(559, 11, '2014-04-09 19:05:14', '2014-04-09 22:05:14', 'Seamos sinceros... más de una vez nos hemos hecho ésta pregunta.\r\n\r\nLa realidad es que el freno para nuestro crecimiento espiritual lo ponemos nosotros mismos. Dios continuamente quiere que crezcamos y nos acerquemos más a Él y, a lo largo de cada día, las oportunidades son muchas... realmente muchas. Somos nosotros lo que en el afan de cada día pasamos por alto éstas preciosas oportunidades que se ponen, literalmente, frente a nuestros ojos.', 'Y yo Cuando?...', '', 'draft', 'open', 'open', '', '', '', '', '2014-04-11 16:35:05', '2014-04-11 19:35:05', '', 0, 'http://www.puertadevida.com/?p=559', 0, 'post', '', 0),
