(675, 11, '2014-06-05 11:41:27', '2014-06-05 14:41:27', 'La familia es el centro del ataque del enemigo en éste tiempo. Es por eso que debemos ponernos en orden de batalla para defender la primera institución creada por Dios en el principio de los tiempos para demostrar su Presencia y establecer su gobierno sobre Todas las Cosas.\r\n\r\n<!--more-->\r\n\r\nDurante muchos años el diablo ha ido minando el camino de millones de familias sembrando peleas, desacuerdos, competencia, falta de amor y muchas otras cosas que no estaban en el plan original de Dios para la creación. Fuimos creados a Su imagen y semejanza, por lo que su propio espíritu mora en nosotros. Ésto significa que nuestra vida cotidiana debería estar marcada por la presencia de Dios en todas las cosas, no solo los días de asistencia a la iglesia.\r\n\r\n<strong>Restauración Familiar</strong> es una serie de enseñanzas que sacan a luz las estrategias del diablo para destruir las familias y así poder hacerles frente, destituyendolas de nuestra vida y estableciendo como base fundamental la palabra de Dios y su misma presencia en nuestro hogar.\r\n\r\nÉsta serie le hablara del verdadero plan de Dios para las Familias, y de como podemos revertir muchas de las situaciones que son adversas en verdaderas bendiciones.\r\n\r\nPara Dios es posible revertir años de destrucción familiar y renovar matrimonios al borde de la separación, hacer volver hijos que han abandonado el hogar e incluso librarlos de adicciones y estilos de vida nocivos.\r\n\r\nLos días 11 al 15 de Junio estaremos compartiendo éstas enseñanzas para que pueda aplicarlas a su vida y familia. La entrada es libre y gratuita.\r\n\r\nSi puedes creer, Dios lo puede hacer\r\n\r\nSi tiene un testimonio del poder restaurador de Dios en su Familia, le invitamos a <strong>dejarnos un comentario</strong> para que sea de bendición para otros.\r\n\r\n&nbsp;', 'Restauración Familiar', 'La familia es el centro del ataque del enemigo en éste tiempo. Es por eso que debemos ponernos en orden de batalla para defender la primera institución creada por Dios en el principio de los tiempos para demostrar su Presencia y establecer su gobierno sobre Todas las Cosas.', 'publish', 'open', 'open', '', 'restfam2014', '', '', '2015-01-23 08:26:10', '2015-01-23 11:26:10', '', 0, 'http://www.puertadevida.com/?p=675', 0, 'post', '', 1),
(681, 0, '2014-06-08 20:06:21', '2014-06-08 23:06:21', '\n<!--more-->\nAUTHOR: marcela\nAUTHOR EMAIL: mamucha_soysho@hotmail.com\nAUTHOR URL: \nSUBJECT: Troquel Virtual\nIP: 186.62.180.27\nArray\n(\n    [Nombre] =&gt; marcela\n    [Dirección] =&gt; soler 10085\n    [Email] =&gt; mamucha_soysho@hotmail.com\n    [Teléfono/Celular] =&gt; 4652660\n    [Salir de Deuda] =&gt; \n    [Aumento de Ingreso Económico] =&gt; Sí\n    [Ser sanado de una Enfermedad] =&gt; \n    [Matrimonio Feliz] =&gt; Sí\n    [Ser libre de Algún vicio] =&gt; \n    [Cosas trabadas que no salen] =&gt; Sí\n    [Ser Libre de alguna opresion] =&gt; Sí\n    [Por alguien en drogas] =&gt; Sí\n    [Un familiar enfermo] =&gt; \n    [Problemas Familiares] =&gt; Sí\n    [Un ascenso laboral] =&gt; \n    [Por una Injusticia] =&gt; \n    [Soledad / Depresion / Desánimo] =&gt; Sí\n    [Por un Amigo] =&gt; \n    [Por un bien material] =&gt; \n    [Por un Exámen o Materia] =&gt; \n    [Otro no Listado] =&gt; \n    [Por favor, describinos su petición] =&gt; \n)\n', 'marcela - 2014-06-08 20:06:21', '', 'publish', 'open', 'open', '', '9346f9081616a40d0d8d1c0e6298e9f5', '', '', '2014-06-08 20:06:21', '2014-06-08 23:06:21', '', 574, 'http://www.puertadevida.com/?post_type=feedback&p=681', 0, 'feedback', '', 0),
(720, 11, '2014-06-13 21:40:48', '2014-06-14 00:40:48', 'Dr. Andrés Bucksot.\r\n\r\nDesde el principio de los tiempos el hombre ha enfrentando un problema con la humanidad en relación al liderazgo en ambas áreas de su vida, es decir, tanto en la familia como en guiar a otros. El simple hecho de ser un hombre y líder para algunos a veces representa un desafío. Es importante entender estos dos papeles son diferentes pero no diferentes llamados.\r\n\r\nEl llamado es el mismo, y es el de ser un líder con cualidades de una hombría verdadera.\r\nComo líder, usted está llamado a ser líder de ambas a reas, en su familia y también ser líder para otros. Pero si no hay entendimiento claro de los diferentes papeles que uno tiene que desarrollar como líder, pueden surgir dificultades y problemas.\r\n\r\nMi esposa y yo hemos viajado desde que empezamos con el ministerio a principio de los 90’s. Hemos hablado a muchos líderes cristianos y seculares a través de los años acerca de diferentes temas por ejemplo como debe ser un hombre en su familia y ser líder para otros. No importa el lugar a donde vamos, siempre se nos pide enseñar ya sea de Liderazgo o de la Familia.\r\n\r\nUna de las cosas más comunes que hemos escuchado es que es muy difícil manejar ambos liderazgo, el de liderar a la familia al mismo tiempo que otros. La pregunta que la gente hace es: “¿Dónde está el balance entre los dos?” El balance se encuentra en entender que aunque los papeles de ser hombre en la familia y ser líder de otros son diferentes, el llamado es el mismo.\r\n\r\nHay muchos buenos hombres líderes de familia y también muchos buenos hombres que son líderes de gente, negocios y empresas, pero ahora se necesita ser un buen líder e ambas áreas. La naturaleza humana ha causado que el hombre vea estas dos formas de liderazgo\r\ncomo si fueran un llamado diferente y no solo como dos papeles diferentes.\r\n\r\nA veces, saber cómo tener un balance fuerte para desarrollar estos dos papeles puede ser confuso. Se nos ha dicho en el trabajo que dejemos a la familia es decir, en la vida personal en la casa y al mismo tiempo que no traigamos la frustraciones del trabajo a la casa. Pareciera que le hombre necesita vivir dos vidas diferentes para no mezclar la una con la otra.\r\n\r\n¿Dónde está el bance? Si guiamos a la familia de la misma manera en a la que guiamos a la gente del trabajo o ministerio, eso nos hace parecer dictadores y si guiamos a la gente del trabajo o ministerio de la misma manera como lo hacemos en la casa, entonces eso nos hace parecer tontos.\r\n\r\n¿Hay alguna manera de ganar? La respuesta es: “Claro que si usted puede ganar.” Necesitamos entender que la manera en la que guiamos a la familia es de la misma manera en la que vamos a guiar a otros. La mayoría de los hombres líderes caen en problemas cuando tratan de separar en dos diferentes categorías el liderazgo, ser líder de otros y ser líder en la familia. De hecho el liderazgo en si mismo uno de sus papeles requiere del mismo tipo de cuidado y atención para que pueda ser verdaderamente efectivo.', 'Una Hombría Verdadera', 'Desde el principio de los tiempos el hombre ha enfrentando un problema con la humanidad en relación al liderazgo en ambas áreas de su vida, es decir, tanto en la familia como en guiar a otros. El simple hecho de ser un hombre y líder para algunos a veces representa un desafío. Es importante entender estos dos papeles son diferentes pero no diferentes llamados.', 'publish', 'open', 'closed', '', 'una-hombria-verdadera', '', '', '2014-06-13 21:40:48', '2014-06-14 00:40:48', '', 0, 'http://www.puertadevida.com/?post_type=product&#038;p=720', 0, 'product', '', 0),
