(712, 11, '2014-06-13 21:21:14', '2014-06-14 00:21:14', 'Este libro ha sido inspirado por el Creador de la Vida y cada una de éstas hojas encierra esa esencia.\r\nEl él han sido insertadas experiencias personales, antiguas y presentes todas ellas con el toque inconfundible del espíritu Santo, principalmente con el fin de llegar al corazón el espíritu de aquellas personas que en éste siglo aún no han decidido que hacer y a quien recurrir para encontrar paz y salvación.', 'Día a Día con el Rey', 'Este libro ha sido inspirado por el Creador de la Vida y cada una de éstas hojas encierra esa esencia.', 'publish', 'open', 'closed', '', 'dia-a-dia-con-el-rey', '', '', '2014-06-13 21:22:28', '2014-06-14 00:22:28', '', 0, 'http://www.puertadevida.com/?post_type=product&#038;p=712', 0, 'product', '', 0),
(713, 11, '2014-06-13 21:22:32', '2014-06-14 00:22:32', 'Dr. Andrés Bucksot\r\n\r\nEl reino de Dios no es algo místico, sino algo tan real como el reino terrenal en donde vivimos.\r\n\r\nHay un Rey sobre todo lo visible e invisible. Él siempre ha sido y siempre será el Rey, porque en Su reino no hay principio ni fin. Es un gozo ser escogido a ser parte.\r\n\r\nPor más de dos décadas hemos dedicado tiempo a hablar, escribir y potencializar a gente con los principios de reino de Dios. El evangelio del reino de Dios será predicado hasta los confines de la tierra en todas las naciones, y entonces llegará el fin. Para mí, el mensaje del reino es lo más importante que hay.\r\n\r\nEl temario del reino de Dios debe ser estudiado y vivido para compartir y proclamar conforme la realidad de sus principios eternos. Cuando uno escucha del mensaje del reino de Dios hay ciertas bases que son necesarias, entender antes de lanzarse a compartirlo.\r\n\r\nPor ejemplo, para compartir con entendimiento del tema del reino de Dios, es necesario entender los propósitos por los cuales Yahweh mandó a Su hijo a la tierra. La religiosidad enseña que Yahweh mandó a Su Hijo para morir en la cruz o para derramar Su sangre.\r\n\r\nEstas acciones fueron necesarias para cumplir con el propósito eterno, para lo cual ha sido enviado, pero esta no es la razón principal de haber sido enviado. La razón principal por la cual el Creador de todos los universos envió a Su Hijo a este mundo y a esta tierra fue para establecer Su reino.\r\n\r\nEs necesario que cada rey tenga dos cosas importantísimas; un territorio y unos ciudadanos.\r\nPorque la gloria de un reino es el tamaño de su territorio y la gloria de un rey es la condición de sus ciudadanos. La calidad del reino y de los reyes está determinada por la condición de ambos\r\naspectos.\r\n\r\nReinando en el reino es revelar las claves del poder y vivir la vida en abundancia que Jesucristo te ha prometido. Él desea que vivas como rey, al igual que él mismo. Te ha hecho rey y te ha llamado a reinar como rey, por lo tanto ahora debes comenzar a reinar como rey.\r\n\r\nJesucristo es rey y él tiene un reino. Su reino fue establecido para beneficio de los habitantes de\r\neste mundo y para sacar el máximo potencial que pueda producir esta tierra. Cuando los\r\nciudadanos del reino de los cielos reconocen estas verdades, sus vidas toman pasos hacia una vida\r\nmás efectiva y con mucho más eficacia.\r\n\r\nReinos y reyes operan bajo condiciones y características que les ayuda a avanzar y crecer. El Tema\r\ndel reino de Dios es importante para entender a Dios y todo lo que hizo para establecer a Su reino\r\naquí en la tierra.\r\n\r\nPara reinar en el reino de Dios, tienes que aprender cómo funciona y cuáles son las claves del\r\nreino. Hay un propósito por el cual el gran YO SOY te escogió. Él te ha llamado a reinar en Su\r\nreino como alguien digno de ser llamado coheredero de Dios.', 'Reinando en el Reino', 'Jesucristo no vino para formar otra religión sino para reinar como el Rey. Él mismo ha establecido el reino de los cielos y basándose en ésta realidad nosotros podemos reinar en ésta vida por medio de Él', 'publish', 'open', 'closed', '', 'reinando-en-el-reino', '', '', '2014-06-13 21:41:10', '2014-06-14 00:41:10', '', 0, 'http://www.puertadevida.com/producto/reinando-en-el-reino/', 0, 'product', '', 0),
