(780, 0, '2014-11-04 18:32:19', '2014-11-04 21:32:19', 'hola pastores..!aki estioy comentadoles que pase muchas cosas aki..no es lo que todos cuentan y piensan..la mujer que me trajo me estafo y no cumplio con nada de lo que me dijo y tuve que salir con mis maletas a buscarme la vida..por suerte un amigo argentino que hace 10 años no veia me dio una mano y me dio de comer durante una semana y me dejo dormir en su sofa..hasta que consegui trabajo en una peluuqueria y el dueño en una semana me ofrecio un local pekeño para alquilar y ahi estoy ahora..y consegui un mejor piso para alkilar con terraza y balcon muy lindo....como siempre mi fe en dios esta intacta..eso me da muchas fuerzas..nunca me olvido de ustedes y sus palabras.siempre los llevo en mi corazon..por favor dele saludos mios a la gente de la iglesia..!!nose cuando podre volver..porque ahora no es cmo antes esta dificil juntar dinero..por la crisis que ahi aki..y todabia estoy ilegal..pero siempre antes de salir a la calle le pido a dios a dios y los angeles que me guarden y me protegan y me siento muy seguro..un abrazo grande..los kiero mucho...=)..atte cristian hermosilla\n<!--more-->\nAUTHOR: cristian hermosilla\nAUTHOR EMAIL: cristian-gonzalo.h@hotmail.com.ar\nAUTHOR URL: \nSUBJECT: [Ministerio Puerta de Vida] Contacto\nIP: 83.41.14.230\nArray\n(\n    [Nombre] =&gt; cristian hermosilla\n    [Email] =&gt; cristian-gonzalo.h@hotmail.com.ar\n    [Su Mensaje] =&gt; hola pastores..!aki estioy comentadoles que pase muchas cosas aki..no es lo que todos cuentan y piensan..la mujer que me trajo me estafo y no cumplio con nada de lo que me dijo y tuve que salir con mis maletas a buscarme la vida..por suerte un amigo argentino que hace 10 años no veia me dio una mano y me dio de comer durante una semana y me dejo dormir en su sofa..hasta que consegui trabajo en una peluuqueria y el dueño en una semana me ofrecio un local pekeño para alquilar y ahi estoy ahora..y consegui un mejor piso para alkilar con terraza y ba