(896, 11, '2014-11-25 16:35:50', '2014-11-25 19:35:50', 'Clase 1 - Juan 3:1-21\r\nNicodemo nunca se imaginó que al visitar a Jesús se vería confrontado con una necesidad fundamental para poder entrar al reino de los cielos, NACER DE NUEVO.\r\nA la vista de cualquier humano tenía todas las buenas cosas que se requiere para vivir bien delante de Dios, pero a la mirada de Jesucristo la faltaba algo, el nuevo nacimiento, conocía la religión, tenía una buena moral y era una persona respetada, sin embargo no había tenido la experiencia de una relación personal con Jesucristo.\r\nCuando tú decidiste recibir a Jesucristo en tu corazón en ese mismo momento sucedió algo maravilloso\r\nNACISTE DE NUEVO ESPIRITUALMENTE – 2 Corintios 5:17 - ATENCIÓN\r\nEl nacer de nuevo no lo da la posición social, ni la buena moral, ni ninguna otra forma de esfuerzo humano, pues es sólo a través de creer y recibir el perdón de pecados por medio de Jesucristo\r\n(Hechos 10:43, Romanos 5:1)\r\nNo debes olvidar que desde el momento de recibir a Jesucristo naciste de nuevo y te convertiste en un BEBE ESPIRITUAL y sabemos que un bebé cuando llega a una familia trae alegría y es hermoso, pero todo mundo espera que ese bebe crezca. De la misma manera Dios espera que crezcas en tu nueva vida y llegues a ser maduro espiritualmente hablando.\r\n¿Cómo puedes lograr ese crecimiento?\r\n1. ALIMENTÁNDOTE A DIARIO CON LA PALABRA DE DIOS.\r\nLee 1 Pedro 2:2.\r\nLa Biblia es el más grande de los tesoros, en ella encontramos todos los principios para vivir en victoria y las respuestas a nuestras necesidades, no necesitas sólo información sino que las verdades bíblicas penetren en tu corazón y ejerzan un cambio de conducta.\r\n2. HABLANDO CON DIOS TODOS LOS DÍAS.\r\nLee Salmos 5:1-3.\r\nOrar no es rezar, es decir, repetir frases por costumbre, orar es platicar con Jesús como lo harías con un amigo, la oración hace que las cosas sucedan y debes saber que Dios está contigo continuamente, dirígele la palabra en acción de gracias y luego pidiéndole que te ayude en todas las cosas.\r\nProponte diariamente platicar con Dios.\r\n3. REUNIÉNDOTE CONSTANTEMENTE CON OTROS CRISTIANOS.\r\nLee Hebreos 10:25\r\nCuando colocas un trozo de leña en el fuego éste se encenderá y se mantendrá ardiendo, pero si lo quitas del fuego se apaga. De la misma manera puedes mantener el fuego de tu nueva vida o apagarlo.\r\nPor esta razón es muy importante que inmediatamente empieces a reunirte en un HOGAR DE REFUGIO y que asistas los días domingos de celebración en el Ministerio Puerta de vida, la persona que te invitó o que está dándote esta clase puede ayudarte. El cometer errores o pasar por problemas puede traerte desánimos pero no debes desistir, por eso necesitas ir a la iglesia, allí disfrutaras de Su Presencia, escucharás mensajes y enseñanzas que transformarán tu vida. El deseo de Dios es que permanezcas fiel en sus sendas, si lo haces la bendición no se hará esperar, tocará tu vida, tu familia y verás la mano de Dios sobre ti.', 'Que ha pasado en mi?', 'Nicodemo nunca se imaginó que al visitar a Jesús se vería confrontado con una necesidad fundamental para poder entrar al reino de los cielos, NACER DE NUEVO.\r\nA la vista de cualquier humano tenía todas las buenas cosas que se requiere para vivir bien delante de Dios, pero a la mirada de Jesucristo la faltaba algo, el nuevo nacimiento, conocía la religión, tenía una buena moral y era una persona respetada, sin embargo no había tenido la experiencia de una relación personal con Jesucristo.', 'publish', 'closed', 'closed', '', 'que-ha-pasado-en-mi', '', '', '2014-11-25 16:35:50', '2014-11-25 19:35:50', '', 0, 'http://www.puertadevida.com/?post_type=ib_educator_lesson&#038;p=896', 0, 'ib_educator_lesson', '', 0),
