(904, 11, '2014-11-26 21:35:22', '2014-11-27 00:35:22', '<h2>Juan 3:1-21</h2>\r\nNicodemo nunca se imaginó que al visitar a Jesús se vería confrontado con una necesidad fundamental para poder entrar al reino de los cielos, <strong>NACER DE NUEVO.</strong>\r\n\r\n&nbsp;\r\n\r\nA la vista de cualquier humano tenía todas las buenas cosas que se requiere para vivir bien delante de Dios, pero a la mirada de Jesucristo la faltaba algo, el nuevo nacimiento, conocía la religión, tenía una buena moral y era una persona respetada, sin embargo no había tenido la experiencia de una relación personal con Jesucristo.\r\n\r\nCuando tú decidiste recibir a Jesucristo en tu corazón en ese mismo momento sucedió algo maravilloso\r\n\r\n<strong> </strong>\r\n\r\n<strong>NACISTE DE NUEVO ESPIRITUALMENTE – 2 Corintios 5:17 - ATENCIÓN</strong>\r\n\r\nEl nacer de nuevo no lo da la posición social, ni la buena moral, ni ninguna otra forma de esfuerzo humano, pues es sólo a través de creer y recibir el perdón de pecados por medio de Jesucristo\r\n\r\n<strong><em>(Hechos 10:43, Romanos 5:1)</em></strong>\r\n\r\nNo debes olvidar que desde el momento de recibir a Jesucristo naciste de nuevo y te convertiste en un <strong>BEBE ESPIRITUAL</strong> y sabemos que un bebé cuando llega a una familia trae alegría y es hermoso, pero todo mundo espera que ese bebe crezca. De la misma manera Dios espera que crezcas en tu nueva vida y llegues a ser maduro espiritualmente hablando.\r\n\r\n¿Cómo puedes lograr ese crecimiento?\r\n\r\n&nbsp;\r\n<ol>\r\n	<li><strong>ALIMENTÁNDOTE A DIARIO CON LA PALABRA DE DIOS.</strong></li>\r\n</ol>\r\n<strong>Lee 1 Pedro 2:2.</strong>\r\n\r\nLa Biblia es el más grande de los tesoros, en ella encontramos todos los principios para vivir en victoria y las respuestas a nuestras necesidades, no necesitas sólo información sino que las verdades bíblicas penetren en tu corazón y ejerzan un cambio de conducta.\r\n<ol start="2">\r\n	<li><strong>HABLANDO CON DIOS TODOS LOS DÍAS.</strong></li>\r\n</ol>\r\n<strong>Lee Salmos 5:1-3.</strong>\r\n\r\nOrar no es rezar, es decir, repetir frases por costumbre, orar es platicar con Jesús como lo harías con un amigo, la oración hace que las cosas sucedan y debes saber que Dios está contigo continuamente, dirígele la palabra en acción de gracias y luego pidiéndole que te ayude en todas las cosas.\r\n\r\nProponte diariamente platicar con Dios.\r\n<ol start="3">\r\n	<li><strong>REUNIÉNDOTE CONSTANTEMENTE CON OTROS CRISTIANOS.</strong></li>\r\n</ol>\r\n<strong>Lee Hebreos 10:25</strong>\r\n\r\nCuando colocas un trozo de leña en el fuego éste se encenderá y se mantendrá ardiendo, pero si lo quitas del fuego se apaga. De la misma manera puedes mantener el fuego de tu nueva vida o apagarlo.\r\n\r\nPor esta razón es muy importante que inmediatamente empieces a reunirte en un <strong>HOGAR DE REFUGIO</strong> y que asistas los días domingos de celebración en el Ministerio Puerta de vida, la persona que te invitó o que está dándote esta clase puede ayudarte. El cometer errores o pasar por problemas puede traerte desánimos pero no debes desistir, por eso necesitas ir a la iglesia, allí disfrutaras de Su Presencia, escucharás mensajes y enseñanzas que transformarán tu vida. El deseo de Dios es que permanezcas fiel en sus sendas, si lo haces la bendición no se hará esperar, tocará tu vida, tu familia y verás la mano de Dios sobre ti.', 'Que ha pasado en Mi?', '', 'publish', 'closed', 'closed', '', 'que-ha-pasado-en-mi', '', '', '2014-11-26 21:36:24', '2014-11-27 00:36:24', '', 0, 'http://www.puertadevida.com/?post_type=course_unit&#038;p=904', 0, 'course_unit', '', 0),
(907, 11, '2014-11-26 21:37:24', '2014-11-27 00:37:24', '<h2>Lucas 8:4-15</h2>\r\nTu vida nueva en Cristo requiere de fundamentos y convicción para poder enfrentar las diferentes opiniones de aquellos que ahora saben de tu cambio de vida y no lo entienden, también de los obstáculos y desafíos que te esperan por delante en tu caminar con Dios. Jesús enseña sobre el sembrador que Él mismo es y sobre la semilla que es la palabra de fe que entró en nosotros y produjo el nacer de nuevo, también de cuatro clases de tierra que son las diferentes decisiones del corazón del que recibió a Cristo un día. Veamos las diferentes decisiones:\r\n<ol>\r\n	<li><strong> V12</strong> – Son aquellos que las ataduras espirituales que el diablo les tendió no les permiten permanecer a causa de la falta de fe, entran en duda y tienden a cuestionar todo en un ambiente de escepticismo, para ellos es importante lo que los demás piensen y hacen caso a las críticas y opiniones de amigos, familiares o terceras personas, terminan en perder lo que Dios les había regalado, su libertad y salvación.</li>\r\n	<li><strong> V13 </strong>– Son aquellos que al recibir a Cristo creen que la felicidad les llegó y todos sus problemas se terminaron como si hubiesen ganado una especie de lotería, tienden a creer que Dios es una especie de supermercado que sólo está para consentir sus deseos y caprichos. Cuando la prueba llega para ver y pesar sus corazones acerca de su amor por el Señor, se apartan hasta enfriarse, terminan en tristemente perder todo lo que Dios les había dado, la verdadera paz y salvación.</li>\r\n	<li><strong> V14 </strong>– Son aquellos que no crecen en la fe a causa de los afanes de la vida, su enfoque está sólo en tener cosas materiales, placer y diversión. Por un tiempo caminan con Dios pero pronto tomarán la senda equivocada hacia las cosas de este mundo, todo terminará en una lejana experiencia de algún día haber conocido a Dios, pierden las más ricas bendiciones del cielo y su salvación.</li>\r\n	<li><strong> V15</strong> – Son Aquellos que nacieron de nuevo y cuidaron de su salvación, permaneciendo en la fe de Cristo Jesús, no temen ni obedecen a las críticas y opiniones de los demás, saben que Dios está con ellos en toda circunstancia y pelean la batalla de la fe, deciden poner sus ojos en el cielo y no en las cosas de la tierra, son conocidos por su apasionado deseo de conocer a Dios, el destino de ellos está sellado en bendición espiritual, familiar y material, disfrutan de la vida eterna.</li>\r\n</ol>\r\n<strong>¿QUÉ CLASE DE TIERRA QUIERES SER TÚ?</strong>\r\n\r\nHoy puedes hacer una oración de compromiso a Dios decidiendo ser buena tierra, para siempre caminar en sus sendas y ser lo que Dios está esperando de ti, sin importar lo que tengas que hacer o enfrentar, con toda seguridad debes saber que al hacerlo el cielo estará siempre abierto para ti. El Señor te bendiga en todo siempre. Felicidades y camina fielmente.', 'Mi Vida Social', '', 'publish', 'closed', 'closed', '', 'mi-vida-social', '', '', '2014-11-26 21:37:24', '2014-11-27 00:37:24', '', 0, 'http://www.puertadevida.com/?post_type=course_unit&#038;p=907', 0, 'course_unit', '', 0),
(909, 11, '2014-11-26 21:38:17', '2014-11-27 00:38:17', 'En nuestra vida cristiana los problemas se convierten en desafíos cuando vivimos una relación de intimidad y amistad con Cristo Jesús, de manera que nos mantiene protegidos. Mientras más cerca estemos del Señor más seguros estaremos.\r\n\r\n&nbsp;\r\n\r\nQué hermoso es saber que Jesucristo vive dentro de cada verdadero creyente, qué hermoso es saber que ahora vive en ti, pero ¿qué valor tiene esto?\r\n<ol>\r\n	<li>Tienes vida eterna <strong><em>(Romanos 6:22-23)</em></strong></li>\r\n	<li>Nos libró de las garras del diablo <strong><em>(Colosenses 1:13)</em></strong></li>\r\n	<li>Tiene cuidado de ti <strong><em>(1 Pedro 5:7)</em></strong></li>\r\n</ol>\r\n<strong>DEBES ENTENDER ESTO</strong>\r\n\r\n<strong>La vida cristiana no es un sistema en el cual vivimos para Dios, sino que DIOS VIVE EN NOSOTROS<em>. (2 Corintios 13:5)</em></strong>\r\n\r\nHabrá ocasiones en que NO SENTIRÁS que lo que ha sucedido en tu vida con Cristo sea una realidad, pero es ahí donde debes entender que tu relación con Dios no es en base a lo que sientes, sino a la certeza de la realidad de que Dios te llamó y está en ti desde que decidiste creer y caminar con Él.\r\n<strong>RECUERDA ESTO</strong>\r\n<ol>\r\n	<li>El diablo intentará hacerte pecar a través de las tentaciones y por lo tanto debes vencerlas y no pecar más, recuerda que ser tentado no es pecado, ceder a tus deseos antiguos que te controlaban es pecar.\r\n<strong><em>(1 Pedro 5:8-9)</em></strong> Dios ofrece ayudarte a resistir y huir del pecado <strong><em>(1 Corintios 10:12-13)</em></strong>.</li>\r\n	<li>Habla con Dios diariamente y confía y encomienda todo a Él, en agradecimiento por cuánto te ama.</li>\r\n	<li>Sigue asistiendo a la iglesia fielmente, pues ahí serás fortalecido con la Palabra y tendrás oportunidad de sentir Su presencia en la adoración.</li>\r\n	<li>Asiste a tu hogar de refugio, allí conocerás más de Su Palabra, pues ir sólo el domingo no es suficiente para mantener tu fuego encendido.</li>\r\n	<li><strong>Te invitamos al próximo Encuentro CARA A CARA.</strong> La persona que te da esta clase puede darte más información y ayudarte.</li>\r\n</ol>\r\n&nbsp;\r\n\r\nHaciendo esto crecerás en tu relación con Dios y cumplirás con sus propósitos en tu vida.\r\n\r\nEl Señor te siga enamorando más de Él día a día.', 'Mi Relación diaria con Jesucristo', '', 'publish', 'closed', 'closed', '', 'mi-relacion-diaria-con-jesucristo', '', '', '2014-11-26 21:38:17', '2014-11-27 00:38:17', '', 0, 'http://www.puertadevida.com/?post_type=course_unit&#038;p=909', 0, 'course_unit', '', 0),
(911, 11, '2014-11-26 21:39:20', '2014-11-27 00:39:20', '¿Qué hacemos con una persona que ha muerto? ¡Lo enterramos! ¡Es la única manera de tratar con un muerto! La Biblia dice que hemos muerto al pecado cuando permitimos que Jesucristo entre a nuestro corazón. <strong><em>(Romanos 6:11, Colosenses 2:12).</em></strong>\r\n\r\n&nbsp;\r\n\r\nEn el bautismo enterramos simbólicamente nuestra vieja vida de pecado, el bautismo no produce la muerte de la vieja naturaleza, sino que es la evidencia exterior de que la muerte del viejo hombre ya se ha realizado. No enterramos a alguien para causarle la muerte, sino que la persona ya tiene que estar muerta.\r\n\r\n&nbsp;\r\n\r\n<strong>¿QUÉ ES EL BAUTISMO?</strong>\r\n\r\nLa palabra bautismo viene del griego “baptizo” que significa sumergir, anegar, cubrir por completo, esta palabra también se usa para referirse al acto de teñir telas, ya que deben ser sumergidas completamente en la tintura que le daría el nuevo color. Este es el bautismo que Jesús nos enseña, de hecho Jesús fue bautizado en el Río Jordán por medio de la inmersión total de su cuerpo a los 30 años. Mateo 3:13-17.\r\n\r\nEl bautismo es el símbolo de la muerte, sepultura y resurrección, cuando la persona es sumergida está enterrando su antigua vida y cuando sale de las aguas está resucitando a una nueva vida, como lo hizo nuestro Señor Jesucristo, de esta manera el nuevo creyente sella la fe en su corazón. El bautismo no salva, sino sólo la fe en Jesucristo.\r\n\r\n&nbsp;\r\n\r\n<strong>¿QUIÉN SE PUEDE BAUTIZAR?</strong>\r\n\r\n<strong><em>(Marcos 16:15-16 - Hechos 2:38)</em></strong>\r\n<ol>\r\n	<li>Aquellos que creen en Jesucristo habiéndose arrepentido de su antigua vida.</li>\r\n	<li>Aquellos que han nacido de nuevo en Cristo.</li>\r\n	<li>Aquellos que lo hacen sinceramente por amor a Dios y no por religiosidad.</li>\r\n</ol>\r\nEs un mandato dado por el Señor Jesucristo para todos aquellos que han creído en Él, a través del bautismo damos testimonio en la tierra y en el cielo de nuestra nueva vida. Mateo 28:19, el bautismo no es una opción sino un mandamiento, si realmente hemos creído en Jesucristo obedeceremos este precioso mandamiento.\r\n\r\n&nbsp;\r\n\r\n<strong>¿QUÉ DEL BAUTISMO DE NIÑOS?</strong>\r\n\r\nLa enseñanza de bautizar niños no tiene base bíblica y es a causa de tradiciones, aunque la edad no es determinante, obviamente se requiere que la persona tenga edad y madurez suficiente para reconocer el significado del bautismo y decidir por su propia voluntad el seguir a Cristo. De los niños Jesús dijo <strong><em>que de ellos es el Reino de Dios</em></strong>. <strong><em>(Mateo 19:14 - Ezequiel 18:20) </em></strong>afirma la justicia de Dios es que los niños no serán castigados por el pecado de sus padres.\r\n\r\n&nbsp;\r\n\r\nLa conciencia activa el pecado, por lo tanto un niño que muere sin bautizarse es un alma salva de conciencia limpia, es decir, no tenía discernimiento del bien o el mal y va directamente a la presencia de Dios, a diferencia de una persona con clara conciencia de lo bueno o lo malo.\r\n\r\nNo permita que ninguna tradición religiosa impida cumplir este mandamiento tan importante, el hacerlo no es faltar al respeto a sus padres que posiblemente lo bautizaron de bebé, ellos querían lo mejor para usted según su comprensión, pero ahora ha aprendido el verdadero significado del bautismo.\r\n\r\n&nbsp;\r\n\r\nCamine en obediencia y de seguro el Señor continuará bendiciendo tu vida.', 'Un paso de Obediencia', '', 'publish', 'closed', 'closed', '', 'un-paso-de-obediencia', '', '', '2014-11-26 21:39:20', '2014-11-27 00:39:20', '', 0, 'http://www.puertadevida.com/?post_type=course_unit&#038;p=911', 0, 'course_unit', '', 0),
