(1332, 2, '2016-05-23 10:13:01', '2016-05-23 13:13:01', 'Serie “Hay tres cosas” 2016 Tema 26\r\nMensajes motivacionales\r\n\r\nN° 26- Hay tres cosas que son inútiles de guardar\r\n<div class="text_exposed_show">\r\n\r\n1- Las apariencias\r\nSin duda vivimos en un mundo cargado de hipocresía, la mayoría quiere aparentar lo que no es, la mayoría busca modelos a quienes imitar, si alguien se hace un tatuaje en el brazo o en el rostro, se produce el efecto dominó y para no sentirse fuera de onda algunos se arruinar el cuerpo y el rostro, el tema es, para quién realmente se está haciendo dicho tatuaje?, es el punto de comparación en realidad quién lo define, la persona se siente inferior si no trata de superar a la otra, la verdad es que si, vivimos en un mundo competitivo, pero eso es diferente a la imitación, esto tiene que ver con superación y es allí donde el individuo debe apuntar, a ser mejor cada día, crecer en conocimiento y capacidad y no caer en la hipocresía que imitando a otros en las malas prácticas uno puede estar mejor, evita ser como los demás, tu eres alguien muy especial.\r\n\r\n2- El rencor\r\nEste mal sin dudas arruina vidas de manera increíble, pues el individuo no se da cuenta que “La marcha va por dentro” le suena?, cuando no desarrollamos la capacidad de desechar cosas que nos ofenden nos convertimos en acumuladores de cosas espirituales que nos van arruinando la vida, cada vez que alguien murmura en su contra y eso llega a sus oídos déjelo pasar de largo, no le preste atención pues el propósito de lo que acaba de oír es quitarle el deseo de avanzar y hacerle retroceder al terreno de lo inútil, use la capacidad que Dios le ha dado para no dejarse arrastrar a ese nivel, su vida vale demasiado para permitir que gente que no le valora se la arruine, cuide su salud emocional usted mismo, nadie lo hará mejor se lo puedo asegurar.\r\n\r\n3- Las ofensas\r\nAlguien dijo en una oportunidad de manera muy acertada, “La palabra es el anzuelo, las ofensas la carnada”, cuanta gente se engancha por sentirse ofendido con razón, o sin razón y enseguida empiezan a elaborar planes mentales para probar que lo dicho no es así, y en ese trámite se le pasan los días, semanas, meses y aún años, familias que no hablan por años por permanecer enganchados por sentirse ofendidos, la pregunta sería. . .de que sirve eso?, cuanta vida se pierde, cuantos momentos que muchas veces son irrecuperables, cuantos abrazos no ofrecidos, pero también cuantos abrazos no recibidos, piense en esto…si aquella persona con la cual usted está ofendido/da se muriera, no le parece que quedaría con una deuda de reconciliación sin pagar?, piénselo, le digo otra vez. . .usted tiene una sola vida no la desperdicie permaneciendo ofendido.\r\n\r\nProverbios 19: 11 La cordura del hombre detiene su furor, Y su honra es pasar por alto la ofensa.\r\n\r\nPastor Jorge Schmarsow\r\n\r\n</div>', 'Tres cosas', '', 'publish', 'open', 'open', '', 'tres-cosas-2', '', '', '2016-05-23 10:13:01', '2016-05-23 13:13:01', '', 0, 'http://www.puertadevida.com/?p=1332', 0, 'post', '', 0),
(1317, 2, '2016-05-12 20:30:14', '2016-05-12 23:30:14', 'Si tuviéramos la capacidad de funcionar conforme a los principios y valores establecidos por Dios en su palabra, tendríamos una vida bendecida en todas las áreas', 'Dios nunca pierde el control', '', 'publish', 'open', 'open', '', 'dios-nunca-pierde-el-control', '', '', '2016-05-12 20:30:14', '2016-05-12 23:30:14', '', 0, 'http://www.puertadevida.com/?p=1317', 0, 'post', '', 0),
