(1319, 2, '2016-05-20 09:49:58', '2016-05-20 12:49:58', 'Juan 19: 30\r\n\r\nCuando Jesús hubo tomado el vinagre,  dijo:  Consumado es.  Y habiendo inclinado la cabeza,  entregó el espíritu.\r\n\r\nMateo 27: 50-53\r\n\r\nConsumado es. . .Tetélestai Gr.\r\n\r\nLos tres significados de esta palabra\r\n\r\n1) ACABÉ  MI TRABAJO = cuando un padre daba una tarea a un hijo, al concluirla el hijo decía al padre: "Tetélestai". Jesús al morir en la cruz, cumplió el propósito del Padre de morir en favor de sus ovejas.\r\n\r\n2) PAGUÉ LA DEUDA = Cuando alguien iba al banco a pagar una cuenta, el banquero colocaba un sello sobre el documento: Tetélestai,\r\nPagado por completo\r\n\r\n3) POSESIÓN DE LA PROPIEDAD = Cuando alguien compraba un terreno y hacia el pago total, recibía la escritura registrada con el sello: Tetélestai. Ahora usted es el dueño por  derecho y de hecho concretado.\r\n\r\nTres áreas que son alcanzadas por el sacrificio de Cristo\r\n\r\n1- Área espiritual  Lucas 4: 18-19, Colosenses 2: 13-15\r\n\r\n2- Área física   Isaías 53: 5\r\n\r\n3- Área Natural     Mateo 27: 50-54\r\n\r\nSacrificio total\r\n\r\nRomanos 8: 32  El que no escatimó ni a su propio Hijo,  sino que lo entregó por todos nosotros,  ¿cómo no nos dará también con él todas las cosas?\r\n\r\nTodas las cosas. Espirituales, Físicas, Emocionales, Económicas', 'Sacrificio total', '', 'publish', 'open', 'open', '', 'sacrificio-total', '', '', '2016-05-20 09:49:58', '2016-05-20 12:49:58', '', 0, 'http://www.puertadevida.com/?p=1319', 0, 'post', '', 0),
