(1334, 2, '2016-05-30 11:46:20', '2016-05-30 14:46:20', '<div class="" data-block="true" data-editor="299b1" data-offset-key="9db0o-0-0">\r\n<div class="_1mf _1mj" data-offset-key="9db0o-0-0"><span data-offset-key="9db0o-0-0"><span data-text="true">Serie “Vida al límite” 2016 Tema 01</span></span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="299b1" data-offset-key="es1ga-0-0">\r\n<div class="_1mf _1mj" data-offset-key="es1ga-0-0"><span data-offset-key="es1ga-0-0"> </span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="299b1" data-offset-key="enrd0-0-0">\r\n<div class="_1mf _1mj" data-offset-key="enrd0-0-0"><span data-offset-key="enrd0-0-0"><span data-text="true">Mensajes motivacionales</span></span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="299b1" data-offset-key="ds64k-0-0">\r\n<div class="_1mf _1mj" data-offset-key="ds64k-0-0"><span data-offset-key="ds64k-0-0"> </span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="299b1" data-offset-key="bvfu-0-0">\r\n<div class="_1mf _1mj" data-offset-key="bvfu-0-0"><span data-offset-key="bvfu-0-0"><span data-text="true">N° 01- El límite de la vida</span></span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="299b1" data-offset-key="cgi8a-0-0">\r\n<div class="_1mf _1mj" data-offset-key="cgi8a-0-0"><span data-offset-key="cgi8a-0-0"><span data-text="true">A diferencia de la serie anterior, esta serie será en un párrafo, pues la intención es ayudar a meditar sobre la gran cantidad de temas sobre límites que podamos hacer.</span></span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="299b1" data-offset-key="d25iq-0-0">\r\n<div class="_1mf _1mj" data-offset-key="d25iq-0-0"><span data-offset-key="d25iq-0-0"><span data-text="true">Quiero comenzar sobre el límite que más preocupa la mayoría de la gente, el límite de la vida, o sea cuando nos enfrentamos a la cruda realidad de la muerte, para la mayoría de la gente ese es un límite infranqueable, nadie escapa de él y allí se termina todo. . . pregunto… ¿será tan así?, claro que no, allí, lejos de terminar todo, allí continúa el camino hacia la eternidad de vida o, para los que no creen eternidad de muerte, quizás alguien que pueda leer este escrito piense y diga, no creo que exista vida después de la muerte, esto sería lo más natural porque para saber si esto es así tendría que morir y luego resucitar trayendo el resultado de tal experiencia, lamentablemente aunque hay muchos que han vuelto de la muerte luego de estar horas, o días muertos, cuando hablaron que hay vida después de la muerte los toman por locos o delirantes, o sea, no les creen porque es muy difícil para el ser humano natural creer en algo que es absolutamente contra naturaleza, como lo es el mundo espiritual, tales testimonios que son absolutamente verídicos, reales e increíbles no logran convencer a nadie pues ninguna de esas personas a logrado ser levantado al punto de adoración por ser alguien que venció la muerte, sin embargo, si hay alguien que venció la muerte hace más de 2000 años y no solo la venció, nos dio esa victoria a cada uno de los que estemos dispuestos a creer, para que la muerte no sea el límite que no se puede cruzar, sino un límite que a sido superado con poder por el autor de la vida y lo hizo para darnos vida y vida en abundancia, los más extraordinario es que, no necesitamos morirnos para disfrutar de dicha vida, lo podemos experimentar mientras naturalmente podamos vivir, una vez que le damos la bienvenida al autor de la vida y le permitimos ser entronado en nuestro corazón, los temores de la muerte desaparecen, pues quién la ha vencido, nos da la fuerza, el poder y la confianza para que, cuando llegue el día podamos atravesar ese límite sin ningún temor y con la plena certidumbre que viviremos eternamente y para siempre con Él.</span></span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="299b1" data-offset-key="cl8lf-0-0">\r\n<div class="_1mf _1mj" data-offset-key="cl8lf-0-0"><span data-offset-key="cl8lf-0-0"> </span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="299b1" data-offset-key="28qre-0-0">\r\n<div class="_1mf _1mj" data-offset-key="28qre-0-0"><span data-offset-key="28qre-0-0"><span data-text="true">Juan 14: 6 Jesús le dijo: Yo soy el camino, y la verdad, y la vida; nadie viene al Padre, sino por mí.</span></span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="299b1" data-offset-key="i5g1-0-0">\r\n<div class="_1mf _1mj" data-offset-key="i5g1-0-0"><span data-offset-key="i5g1-0-0"> </span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="299b1" data-offset-key="1kn7j-0-0">\r\n<div class="_1mf _1mj" data-offset-key="1kn7j-0-0"><span data-offset-key="1kn7j-0-0"><span data-text="true">Pastor Jorge Schmarsow www.puertadevida.com</span></span></div>\r\n</div>', 'Vida al Limite', '', 'publish', 'open', 'open', '', 'vida-al-limite', '', '', '2016-05-30 11:50:57', '2016-05-30 14:50:57', '', 0, 'http://www.puertadevida.com/?p=1334', 0, 'post', '', 0),
(1327, 2, '2016-05-20 12:49:16', '2016-05-20 15:49:16', '<strong>Serie “Hay tres cosas” 2016 Tema 1</strong>\r\n\r\n<strong>Mensajes motivacionales</strong>\r\n\r\n<strong>N° 1    Hay tres cosas que intentan impedir que puedas alcanzar tus metas.</strong>\r\n\r\n<strong>1- La realidad</strong>\r\n\r\nEs la que puedes ver y oír, apunta a anular la fe con la que emprendiste tu desafío, la fe dice. . .se puede, la realidad te dice...es imposible\r\n\r\n<strong>2- Las malas compañías</strong>\r\n\r\n1 Corintios 15: 33 dice que las malas conversaciones corrompen las buenas costumbres, hay gente corrosiva y si no los detectas a tiempo, terminaran por corromper, debilitar y destruir tu fe.\r\n\r\n<strong>3- Perder la determinación</strong>\r\n\r\nSolo alcanzamos aquello en lo cual nos enfocamos, si has determinado algo, mantente firme, constante y perseverante, recuerda la fábula de la tortuga y la liebre, ésta última estaba muy segura que ganaría la carrera y por tal razón se echó a dormir pensando que la tortuga jamás podría llegar a la meta, sin embargo, la perseverancia y determinación de la tortuga le dio su premio.\r\n\r\nSe fiel hasta la muerte, y yo te daré la corona de la vida. Ap. 2:10\r\n\r\nPastor Jorge Schmarsow   <a href="http://www.puertadevida.com">www.puertadevida.com</a>', 'Tres cosas', '', 'publish', 'open', 'open', '', 'tres-cosas', '', '', '2016-05-20 12:49:16', '2016-05-20 15:49:16', '', 0, 'http://www.puertadevida.com/?p=1327', 0, 'post', '', 0),
