(1341, 2, '2016-06-01 12:57:34', '2016-06-01 15:57:34', '<div class="" data-block="true" data-editor="d1qs0" data-offset-key="6u7el-0-0">\r\n<div class="_1mf _1mj" data-offset-key="6u7el-0-0"><span data-offset-key="6u7el-0-0"><span data-text="true">Serie “Vida al límite” 2016 Tema 02</span></span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="d1qs0" data-offset-key="ejd5n-0-0">\r\n<div class="_1mf _1mj" data-offset-key="ejd5n-0-0"><span data-offset-key="ejd5n-0-0"><span data-text="true">Mensajes motivacionales</span></span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="d1qs0" data-offset-key="1pj56-0-0">\r\n<div class="_1mf _1mj" data-offset-key="1pj56-0-0"><span data-offset-key="1pj56-0-0"> </span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="d1qs0" data-offset-key="20uoe-0-0">\r\n<div class="_1mf _1mj" data-offset-key="20uoe-0-0"><span data-offset-key="20uoe-0-0"><span data-text="true">N° 02- El límite de la paciencia</span></span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="d1qs0" data-offset-key="17v8c-0-0">\r\n<div class="_1mf _1mj" data-offset-key="17v8c-0-0"><span data-offset-key="17v8c-0-0"> </span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="d1qs0" data-offset-key="al3ms-0-0">\r\n<div class="_1mf _1mj" data-offset-key="al3ms-0-0"><span data-offset-key="al3ms-0-0"><span data-text="true">¿A oído usted esta frase? “La paciencia tiene un límite”, creo que si, es más estoy seguro que en algún momento también la pronuncio, pero la verdad es que la paciencia no tiene límites, el límite es al que yo puedo llegar o sea hasta donde se me acaba la paciencia, pero que a uno en forma individual se le acabe la paciencia no significa que esa sea la regla universal, la paciencia se resume con esta definición “La ciencia de la paz”, es vivir en un estado de paz más allá de nuestra gran cantidad de dificultades o problemas del diario vivir, la paciencia te da la posibilidad de analizar las cosas de una manera muy diferente, a pensar con más detenimiento algo antes de emitir juicio sobre ello, la paz es fundamental para la salud, una persona estresada corre riesgo de enfermarse pues las preocupaciones son tantas que no alcanza a satisfacer sus resoluciones, allí es donde la paciencia debe ser ejercitada de esta manera. Piense que sucedería si usted no interviene en determinado asunto en el momento de mayor demanda, ejemplo, una discusión familiar donde todos hablan al mismo tiempo y no se llega a nada, que sucedería si usted se calla, analiza la situación con tiempo y luego llama al dialogo, ¿no le parece que lograría mejores resultados que de haber intervenido en plena discusión?, eso es la paciencia, tomarse el tiempo necesario para que las cosas se acomoden de la mejor manera y no sufra el desgaste que se sufre cuando todo es adverso y no hay salida, un pastor amigo y muy querido que hoy está en la presencia de Dios tenía este dicho que siempre tengo presente cuando de paciencia se trata “La almohada es la mejor consejera”, o sea mañana el problema se verá diferente al día de hoy, no porque el problema cambie, sino porque yo habré descansado mi mente para analizarlo mejor.</span></span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="d1qs0" data-offset-key="f9l7q-0-0">\r\n<div class="_1mf _1mj" data-offset-key="f9l7q-0-0"><span data-offset-key="f9l7q-0-0"> </span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="d1qs0" data-offset-key="d1ptc-0-0">\r\n<div class="_1mf _1mj" data-offset-key="d1ptc-0-0"><span data-offset-key="d1ptc-0-0"><span data-text="true">Santiago 1: 4 Mas tenga la paciencia su obra completa, para que seáis perfectos y cabales, sin que os falte cosa alguna. </span></span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="d1qs0" data-offset-key="9tghi-0-0">\r\n<div class="_1mf _1mj" data-offset-key="9tghi-0-0"><span data-offset-key="9tghi-0-0"> </span></div>\r\n</div>\r\n<div class="" data-block="true" data-editor="d1qs0" data-offset-key="6angd-0-0">\r\n<div class="_1mf _1mj" data-offset-key="6angd-0-0"><span data-offset-key="6angd-0-0"><span data-text="true">Pastor Jorge Schmarsow www.puertadevida.com</span></span></div>\r\n</div>', 'Vida al limite', '', 'publish', 'open', 'open', '', 'vida-al-limite-2', '', '', '2017-03-13 18:08:13', '2017-03-13 21:08:13', '', 0, 'http://www.puertadevida.com/?p=1341', 0, 'post', '', 0),
