INSERT INTO `pdvwpcw_courses` (`course_id`, `course_title`, `course_desc`, `course_opt_completion_wall`, `course_opt_use_certificate`, `course_opt_user_access`, `course_unit_count`, `course_from_name`, `course_from_email`, `course_to_email`, `course_message_unit_complete`, `course_message_course_complete`, `course_message_unit_not_logged_in`, `course_message_unit_pending`, `course_message_unit_no_access`, `course_message_unit_not_yet`, `course_message_quiz_open_grading_blocking`, `course_message_quiz_open_grading_non_blocking`, `email_complete_module_option_admin`, `email_complete_module_option`, `email_complete_module_subject`, `email_complete_module_body`, `email_complete_course_option_admin`, `email_complete_course_option`, `email_complete_course_subject`, `email_complete_course_body`, `email_quiz_grade_option`, `email_quiz_grade_subject`, `email_quiz_grade_body`, `email_complete_course_grade_summary_subject`, `email_complete_course_grade_summary_body`) VALUES
(1, 'Discipulado', 'En este curso ud aprendera la visión y la forma de trabajo de nuestro ministerio. A la vez desarrollara una vida espiritual personal a través de la incorporación en su estilo de vida de elementos y habitos clave en su desarrollo.', 'completion_wall', 'use_certs', 'default_hide', 4, 'Ministerio Puerta de Vida', 'info@puertadevida.com', '2puertadevida@gmail.com', 'Ud ha completado un unidad.', 'Ha completado el curso. Felicitaciones!', 'No podrá ver ésta unidad hasta que se haya identificado.', 'Ha completado ésta unidad? entonces márquela como Completada.', 'Lo sentimos, pero no está autorizado para acceder a éste curso.', 'Necesita completar la unidad anterior antes de seguir.', 'El examen ha sido enviado a su instructor. Una vez corregido, se le concederá acceso a la siguiente unidad.', 'Su examen ha sido enviado a su instructor y será corregido en breve. Ha completado ésta unidad..', 'send_email', 'send_email', 'Módulo {MODULE_TITLE} - Completado.', 'Hola {USER_NAME}\r\n\r\nGran trabajo al completar el módulo "{MODULE_TITLE}"\r\n\r\n{SITE_NAME}\r\n{SITE_URL}', 'send_email', 'send_email', 'Curso {COURSE_TITLE} - Completado', 'Hola {USER_NAME}\r\n\r\nGran trabajo al completar el curso "{COURSE_TITLE}"\r\nFelicitaciones!\r\n\r\n{SITE_NAME}\r\n{SITE_URL}', 'send_email', '{COURSE_TITLE} - Examen para "{QUIZ_TITLE}"', 'Hola {USER_NAME}\r\n\r\nLa calificación para "{QUIZ_TITLE}" es: \r\n{QUIZ_GRADE} \r\n\r\nÉsta calificación fue asignada al completar la unidad:\r\n{UNIT_URL}\r\n\r\n{QUIZ_RESULT_DETAIL}\r\n\r\n{SITE_NAME}\r\n{SITE_URL}', 'Ha completado el curso "{COURSE_TITLE}"', 'Hola {USER_NAME}\r\n\r\nFelicitaciones por completar el curso "{COURSE_TITLE}"! Fantástico!\r\n\r\nSu calificación final es: {CUMULATIVE_GRADE} \r\n\r\nAquí hay un resumen de las calificaciones obtenidas:\r\n{QUIZ_SUMMARY}\r\n\r\nPuede descargar su certificado a través de éste enlace:\r\n{CERTIFICATE_LINK}\r\n\r\nesperamos haya podido incorporar todos los principios de éste curso!\r\n\r\n{SITE_NAME}\r\n{SITE_URL}'),
(2, 'Academia de Líderes', 'Academia es un nivel de capacitación por encima de las enseñanzas que se imparten a los miembros del ministerio. Es la base fundamental sobre la cual se', 'completion_wall', 'use_certs', 'default_hide', 34, 'Ministerio Puerta de Vida', 'info@puertadevida.com', 'luciano_schmarsow@yahoo.com.ar', 'Has completado la unidad.', 'Felicitaciones!, has completado el curso', 'No puedes ver ésta unidad hasta que te identifiques.', 'Has completado ésta unidad? entonces marcarla como completada.', 'Lo sentimos, pero no estás autorizado a acceder a éste curso.', 'Necesitas completar la anterior antes de seguir.', 'Su examen ha sido enviado para su aprobación al instructor. Una vez que haya sido revisado y cargado, podrás acceder a la próxima unidad.', 'Su examen ha sido enviado para su aprobación al instructor. Has completado ésta unidad.', 'send_email', 'send_email', 'Modulo {MODULE_TITLE} - Completado.', 'Hola {USER_NAME}\r\n\r\nGran trabajo al completar el módulo "{MODULE_TITLE}"!\r\n\r\n{SITE_NAME}\r\n{SITE_URL}', 'send_email', 'send_email', 'Curso {COURSE_TITLE} - Completado', 'Hola {USER_NAME}\r\n\r\nGran trabajo al completar el curso "{COURSE_TITLE}"! Fantastico!\r\n\r\n{SITE_NAME}\r\n{SITE_URL}', 'send_email', '{COURSE_TITLE} - Exámen de aprobación "{QUIZ_TITLE}"', 'Hola {USER_NAME}\r\n\r\nEl resultado del "{QUIZ_TITLE}" es: \r\n{QUIZ_GRADE} \r\n\r\nÉste corresponde a la unidad:\r\n{UNIT_URL}\r\n\r\n{QUIZ_RESULT_DETAIL}\r\n\r\n{SITE_NAME}\r\n{SITE_URL}', 'Resultado final para el curso "{COURSE_TITLE}"', 'Hola {USER_NAME}\r\n\r\nFelicitaciones por completar el curso "{COURSE_TITLE}"! Lo has hecho muy bien!\r\n\r\nEL promedio de calificación para el curso es: {CUMULATIVE_GRADE} \r\n\r\nAqúi puedes ver un resumen de tu examen:\r\n{QUIZ_SUMMARY}\r\n\r\nPuedes descargar el certificado de aprobación desde éste enlace:\r\n{CERTIFICATE_LINK}\r\n\r\nEsperamos que haya sido de bendición para tu vida!\r\n\r\n{SITE_NAME}\r\n{SITE_URL}');
